fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alopecia_mental_retardation_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :alopecia_mental_retardation_syndrome,
        :autosomal_recessive_disease ;
    :has_definition "An alopecia-mental retardation syndrome that has_material_basis_in variation in chromosome 18q11.2â€“q12.2." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amed_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :digenic_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by global developmental delay with impaired intellectual development, onset of bone marrow failure and myelodysplastic syndrome in childhood, and poor overall growth with short stature and that has_material_basis_in homozygous or compound heterozygous mutation in the ADH5 gene on chromosome 4q accompanied by a specific homozygous or heterozygous allele in the ALDH2 gene (E504K) on chromosome 12q24. Defects in both of these genes are necessary for the disorder to manifest, consistent with digenic inheritance." ;
    :has_exact_synonym "AMEDS" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amelogenesis_imperfecta_type_1j rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :amelogenesis_imperfecta,
        :autosomal_recessive_disease ;
    :has_definition "An amelogenesis imperfecta that has_material_basis_in homozygous mutation in the ACPT on chromosome 19q13." ;
    :has_exact_synonym "Amelogenesis imperfecta, type IJ" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :nervous_system_disease,
        :physical_disorder ;
    :has_definition "A nervous system disease that is characterized by development of multiple joint contractures affecting two or more areas of the body prior to birth." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_supratentorial_embryonal_tumor_with_multilayered_rosettes_c19mc_altered rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_embryonal_tumor_with_multilayered_rosettes_c19mc_altered ;
    :has_definition "A childhood embryonal tumor with multilayered rosettes, C19MC-altered that arises from the supratentorial brain and occurs in children." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hypoalphalipoproteinemia_1 rdfs:subClassOf :hypolipoproteinemia ;
    :has_definition "A hypolipoproteinemia that is characterized by low levels of high-density lipoprotein in the blood and that has_material_basis_in heterozygous mutation in the ABC1 gene on chromosome 9q31, which is also the site of mutations causing Tangier disease." ;
    :has_exact_synonym "familial HDL deficiency",
        "familial hypoalphalipoproteinemia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hypoalphalipoproteinemia_2 rdfs:subClassOf :hypolipoproteinemia ;
    :has_definition "A hypolipoproteinemia that is characterized by dysfunctional apoA-I production, resulting in undetectable levels of apoA-I in serum and in markedly low levels of serum high density lipoprotein cholesterol, is generally an autosomal recessive disorder associated with extensive atherosclerosis, xanthomas, and corneal opacities, and that has_material_basis_in homozygous, compound heterozygous, or heterozygous mutation in the APOA1 gene on chromosome 11q23." ;
    :has_exact_synonym "Apolipoprotein A-I deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arrhythmogenic_right_ventricular_dysplasia_14 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :arrhythmogenic_right_ventricular_cardiomyopathy,
        :autosomal_dominant_disease ;
    :has_definition "An arrhythmogenic right ventricular dysplasia that characterized by palpitations, chest pain, and presyncope and that has_material_basis_in heterozygous mutation in the CDH2 gene on chromosome 18q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amelogenesis_imperfecta_type_2a6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :amelogenesis_imperfecta,
        :autosomal_recessive_disease ;
    :has_definition "An amelogenesis imperfecta that is characterized by enamel of normal thickness that is hypomineralized and has a mottled appearance and that has_material_basis_in homozygous mutation in the G protein-coupled receptor-68 (GPR68) on chromosome 14q32." ;
    :has_exact_synonym "Amelogenesis imperfecta, hypomaturation type, IIA6" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anauxetic_dysplasia_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :anauxetic_dysplasia,
        :autosomal_recessive_disease ;
    :has_definition "A spondyloepimetaphyseal dysplasia that is has_material_basis_in homozygous or compound heterozygous mutation in the POP1 gene on chromosome 8q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anauxetic_dysplasia_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :anauxetic_dysplasia,
        :autosomal_recessive_disease ;
    :has_definition "A spondyloepimetaphyseal dysplasia that is characterized by severe short stature, brachydactyly, skin laxity, joint hypermobility, and joint dislocations and that has_material_basis_in homozygous mutation in the NEPRO gene on chromosome 3q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 7q11.2." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_2 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 19q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 1p36." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_4 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 5p15.2-p14.3." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_5 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome Xp22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_6 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 9p21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_7 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 11q24-q25." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_8 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 14q23." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_9 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 2q33.1." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_10 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 8q12.1." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_11 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and has been mapped to chromosome 8p22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracranial_berry_aneurysm_12 rdfs:subClassOf :intracranial_berry_aneurysm ;
    :has_definition "An intracranial berry aneurysm that is characterized by rupture of an intracranial aneurysm, an outpouching or sac-like widening of a cerebral artery, leads to a subarachnoid hemorrhage, a sudden-onset disease that can lead to severe disability and death and that has_material_basis_in heterozygous mutation in the THSD1 gene on chromosome 13q14." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_bcr_abl1 rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by blasts that harbor BCR-ABL1 translocation in the absence of a history and clinical and laboratory features of chronic myelogenous leukemia." ;
    :has_exact_synonym "Acute myeleoid leukemia with BCR-ABL1" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_valve_disease_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :bicuspid_aortic_valve_disease ;
    :has_definition "A bicuspid aortic valve disease that is characterized by aortic stenosis and/or bicuspid aortic valve, associated in some patients with aneurysm of the aortic root and/or ascending aorta and that has_material_basis_in heterozygous mutation in the ROBO4 gene on chromosome 11q24." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :arthrogryposis_multiplex_congenita ;
    :has_definition "An arthrogryposis multiplex congenita that has_material_basis_in homozygous or compound heterozygous mutation in the LGI4 gene on chromosome 19q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :arthrogryposis_multiplex_congenita ;
    :has_definition "An arthrogryposis multiplex congenita that is characterized by decreased fetal movements, hypotonia, variable skeletal defects, including clubfoot and scoliosis, and delayed motor milestones with difficulty walking and that has_material_basis_in homozygous or compound heterozygous mutation in the SYNE1 gene on chromosome 6q25." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :arthrogryposis_multiplex_congenita ;
    :has_definition "An arthrogryposis multiplex congenita that has_material_basis_in homozygous mutation in the SCYL2 gene on chromosome 12q23." ;
    :has_exact_synonym "Zain syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :arthrogryposis_multiplex_congenita ;
    :has_definition "An arthrogryposis multiplex congenita that has_material_basis_in homozygous or compound heterozygous mutation in the TOR1A gene on chromosome 9q34." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_mental_retardation_hypotonic_facies_syndrome_1 rdfs:subClassOf :syndromic_x_linked_intellectual_disability ;
    :has_definition "A syndromic X-linked intellectual disability that is characterized primarily by severe mental retardation, dysmorphic facies, and a highly skewed X-inactivation pattern in carrier women and that has_material_basis_in mutation in the ATRX gene. X-linked mental retardation-hypotonic facies syndrome comprises several syndromes previously reported separately. These include Carpenter-Waziri, Holmes-Gang, and Smith-Fineman-Myers syndromes. X-linked alpha-thalassemia/mental retardation syndrome is an allelic disorder with a similar phenotype with the addition of alpha-thalassemia and Hb H inclusion bodies in erythrocytes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_intellectual_developmental_disorder_109 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndromic_x_linked_intellectual_disability,
        :x_linked_recessive_disease ;
    :has_definition "A syndromic X-linked intellectual disability characterized by mildly to moderately impaired intellectual development associated with learning difficulties, communication deficits, attention problems, hyperactivity, and autistic behavior and that has_material_basis_in disruption of the FMR2 gene (AFF2), either by expansion of a CCG repeat in the 5-prime untranslated region or by deletion." ;
    :has_exact_synonym "Fragile XE syndrome",
        "fragile site on chromosome Xq28" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:syndromic_x_linked_intellectual_disorder_lujan_fryns_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_facial_shape ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndromic_x_linked_intellectual_disability,
        :x_linked_recessive_disease ;
    :has_definition "A syndromic X-linked intellectual disability that is characterized by a tall, marfanoid stature, distinct facial dysmorphism and behavioral problems and that has_material_basis_in hemizygous mutation in the MED12 gene on chromosome Xq13. Opitz-Kaveggia syndrome is an allelic disorder with an overlapping phenotype." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_periodontal_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :joint_hypermobility ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hyperextensible_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :widened_atrophic_scar ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by an Ehlers-Danlos syndrome phenotype combined with severe periodontal inflammation and that has_material_basis_in heterozygous mutation in the C1R gene on chromosome 12p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_periodontal_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in heterozygous mutation in the C1S gene on chromosome 12p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pretibial_dystrophic_epidermolysis_bullosa rdfs:subClassOf :epidermolysis_bullosa_dystrophica ;
    :has_definition "An epidermolysis bullosa dystrophica that is characterized by recurrent blistering and scarring, mainly in the pretibial area and that has_material_basis_in heterozygous or compound heterozygous mutation in the type VII collagen gene (COL7A1) on chromosome 3p21. The lesions often show lichenoid features. Pretibial epidermolysis bullosa is allelic to autosomal dominant and recessive dystrophic epidermolysis bullosa." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:king_denborough_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myopathy ;
    :has_definition "A myopathy that is characterized by distinctive facies, ptosis, downslanted palpebral fissures, widely spaced eyes, epicanthal folds, low-set ears, malar hypoplasia, micrognathia, high-arched palate, clinodactyly, single palmar crease, pectus excavatum, winging of the scapulae, lumbar lordosis, and mild thoracic scoliosis. Pathogenic variants in RYR1 have been found in some individuals with King-Denborough syndrome." ;
    :has_exact_match "MESH:C536883",
        "OMIM:619542" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_1b rdfs:subClassOf :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by multiple areas of reduced mitochondrial oxidative activity running along a limited extent of the longitudinal axis of the muscle fiber, so-called 'minicores' and that has_material_basis_in homozygous or compound heterozygous mutation in the RYR1 gene on chromosome 19q13. Multiminocore disease is broadly classified into four groups: classic form, moderate form with hand involvement, antenatal form with arthrogryposis multiplex congenita, and ophthalmoplegic form." ;
    :has_exact_synonym "multiminicore disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhabdomyolysis_myalgia_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cramp ],
        :myopathy ;
    :has_definition "A myopathy that is characterized by muscle breakdown (rhabdomyolysis), heat and exertion-related muscle pain (myalgia) and cramping symptoms, severe muscle pain, sudden elevation and subsequent fall of serum creatine phosphokinase levels and products of muscle breakdown in the urine (myoglobinuria). Associated with RYR1 variations. Rhabdomyolysis is associated with a range of external triggers, including strenuous exercise beyond the limit of fatigue, heat stress, illicit drug or alcohol abuse, use of supplements or certain medications, recent viral illness or muscle trauma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autoimmune_epilepsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_central_nervous_system,
        :epilepsy ;
    :has_definition "An epilepsy that is characterized by new-onset refractory seizures along with subacute progressive cognitive decline and behavioral or psychiatric dysfunction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberculous_encephalopathy rdfs:subClassOf :tuberculosis ;
    :has_definition "A tuberculosis that is characterized by cerebral edema sometimes with features similar to acute disseminated encephalomyelitis (ADEM) and may manifest with a variety of symptoms ranging from focal neurological deficits to convulsions and decreased conscious state." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_large_b_cell_lymphoma_activated_b_cell_type rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is characterized by the expression of CD44, PKCbeta1, Cyclin D2, BCL-2, and IRF4/MUM1 genes." ;
    :has_exact_synonym "DLBCL ABC type" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_large_b_cell_lymphoma_germinal_center_b_cell_type rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is characterized by the expression of CD10, BCL-6, A-myb, and LMO2 genes, BCL-2 translocation, and c-REL amplification." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_necrotizing_pancreatitis rdfs:subClassOf :acute_pancreatitis ;
    :has_definition "An acute pancreatitis that is characterized by one or more areas of necrosis in the pancreas with varying degree of involvement of the surrounding tissues or organ systems." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_hemorrhagic_pancreatitis rdfs:subClassOf :acute_pancreatitis ;
    :has_definition "An acute pancreatits that is characterized by acute inflammation of the pancreas in which the initial edematous pancreatitis evolved into necrosis accompanied by hemorrhage." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cowden_syndrome_4 rdfs:subClassOf :cowden_syndrome ;
    :has_definition "A Cowden syndrome that has_material_basis_in heterozygous germline hypermethylation of the KLLN gene on chromosome 10q23." .

