    :has_exact_synonym "X-linked neurohypophyseal diabetes insipidus" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_nephrogenic_diabetes_insipidus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :nephrogenic_diabetes_insipidus,
        :x_linked_recessive_disease ;
    :has_definition "A nephrogenic diabetes insipidus that is characterized by the inability of the renal collecting ducts to absorb water in response to antidiuretic hormone and that has_material_basis_in a mutation in the gene encoding the vasopressin V2 receptor (AVPR2) on chromosome Xq28." ;
    :has_exact_synonym "nephrogenic diabetes insipidus type 1" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephrogenic_diabetes_insipidus_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :nephrogenic_diabetes_insipidus ;
    :has_definition "A nephrogenic diabetes insipidus that is characterized by the inability of the renal collecting ducts to absorb water in response to antidiuretic hormone and that has_material_basis_in heterozygous, homozygous, or compound heterozygous mutation in the gene encoding the aquaporin-2 water channel (AQP2), which maps to chromosome 12q13." ;
    :has_exact_synonym "autosomal nephrogenic diabetes insipidus-2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dicer1_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by an increased risk of developing pleuropulmonary blastoma, multinodular goiter, ovarian Sertoli-Leydig cell tumors, and/or other types of tumors, and that has_material_basis_in heterozygous mutation in the DICER1 gene on chromosome 14q32. Mutations of the gene encoding the endoribonuclease, Dicer, disrupts the biogenesis and processing of miRNAs with subsequent disruption in control of gene expression." ;
    :has_exact_synonym "PPB familial tumor susceptibility syndrome",
        "Pleuro-pulmonary blastoma familial tumor susceptibility",
        "Pleuro-pulmonary blastoma familial tumor susceptibility syndrome"@en,
        "Pleuropulmonary blastoma familial tumor susceptibility syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bn2_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is categorized as BN2 with high probability by the LymphGen algorithm. This is based on a combination of genetic features and BN2 DLBCLs often, but do not always, have a translocation involving the BCL6 locus and/or some combination of mutations affecting NOTCH2, TNFAIP3, BCL10 and UBE2A. This subgroup also commonly has mutations due to aberrant somatic hypermutation affecting CD70, which can be coding or non-coding." ;
    :has_exact_synonym "BN2 DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ezb_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is categorized as EZB with high probability by the LymphGen algorithm. This is based on a combination of genetic features and EZB DLBCLs often, but do not always, have hot spot mutations in EZH2 and/or a BCL2 translocation. This class can be further subdivided into two sub-classes EZB-MYC+ and EZB-MYC- using the double hit gene expression signature (DHITsig). This subgroup also commonly has mutations due to aberrant somatic hypermutation affecting IRF8, which can be coding or non-coding." ;
    :has_exact_synonym "EZB DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mcd_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is categorized as MCD with high probability by the LymphGen algorithm. This is based on a combination of genetic features and MCD DLBCLs often, but do not always, have the most common hot spot mutation in MYD88 (L265P) and/or activating mutations in CD79B. This subgroup also commonly has mutations due to aberrant somatic hypermutation affecting PIM1 and/or ETV6, which can be coding or non-coding." ;
    :has_exact_synonym "MCD DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:n1_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is categorized as N1 with high probability by the LymphGen algorithm. This is based on a combination of genetic features. Although N1 DLBCLs always have an activating mutation affecting NOTCH1, LymphGen can assign cases with this mutation to other classes, depending on the presence of other genetic features." ;
    :has_exact_synonym "N1 DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:st2_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is categorized as ST2 with high probability by the LymphGen algorithm. This is based on a combination of genetic features and ST2 DLBCLs often, but do not always, have missense or nonsense mutations affecting TET2 and NFKBIA. This subgroup also commonly has mutations due to aberrant somatic hypermutation affecting some combination of SGK1, ZFP36L1, SOCS1, HIST1H1E and CD83, which can be coding or non-coding." ;
    :has_exact_synonym "ST2 DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:a53_diffuse_large_b_cell_lymphoma rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma that is characterized by aneuploidy with TP53 inactivation." ;
    :has_exact_synonym "A53 DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ezb_myc_diffuse_large_b_cell_lymphoma rdfs:subClassOf :ezb_diffuse_large_b_cell_lymphoma ;
    :has_definition "An EZB diffuse large B-cell lymphoma that expresses the double hit gene expression signature (DHITsig+) according to gene expression profiling. In addition to the features characteristic of EZB, these cases commonly, but do not always, harbour MYC translocations and DDX3X mutations." ;
    :has_exact_synonym "EZB-MYC+ DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ezb_myc_diffuse_large_b_cell_lymphoma rdfs:subClassOf :ezb_diffuse_large_b_cell_lymphoma ;
    :has_definition "An EZB diffuse large B-cell lymphoma that does not express the double hit gene expression signature (DHITsig-) according to gene expression profiling. These cases tend to have few MYC translocations or DDX3X mutations." ;
    :has_exact_synonym "EZB-MYC- DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:craniofacial_dysmorphism_skeletal_anomalies_and_mental_retardation_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by abnormal development of the brain and structures in the face and torso including facial dysmorphism, intellectual deficit costovertebral abnormalities, and delayed development of speech and movement (motor) skills." ;
    :has_exact_synonym "Cerebro-facio-thoracic dysplasia",
        "Cerebrofaciothoracic dysplasia",
        "Pascual-Castroviejo syndrome",
        "TMCO1 defect syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:teebi_hypertelorism_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome characterized by hypertelorism, prominent forehead, thick eyebrows, and short nose with broad and depressed features." ;
    :has_exact_synonym "Brachycephalofrontonasal dysplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:teebi_hypertelorism_syndrome_2 rdfs:subClassOf :teebi_hypertelorism_syndrome ;
    :has_definition "A Teebi hypertelorism syndrome that has_material_basis_in mutation in heterozygous mutation in the CDH11 gene on chromosome 16q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marsili_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pain_agnosia ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by a lowered ability to sense pain, to experience temperature, and to sweat and that has_material_basis_in heterozygous mutation in the ZFHX2 gene on chromosome 14q11." ;
    :has_exact_synonym "congenital analgesia",
        "congenital insensitivity to pain" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blastic_plasmacytoid_dendritic_cell_neoplasm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        :acute_leukemia ;
    :has_definition "An acute leukemia that is derived from the precursors of plasmacytoid dendritic cells, with a high frequency of cutaneous and bone marrow involvement and leukemic dissemination. Skin lesions appearing on the arms, legs, face and neck are the most common BPDCN symptom. Other symptoms include low counts of healthy blood cells and swollen lymph nodes." ;
    :has_exact_synonym "Agranular CD4+ CD56+ Hematodermic Neoplasm/Tumor",
        "Agranular CD4+ Natural Killer Cell Leukemia",
        "Blastic NK-Cell Lymphoma",
        "Blastic Natural Killer Leukemia/Lymphoma",
        "CD4+/CD56+ Hematodermic Neoplasm",
        "natural killer (NK) cell leukemia/lymphoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectodermal_dysplasia_and_immune_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_immune_system_physiology ],
        :ectodermal_dysplasia,
        :primary_immunodeficiency_disease ;
    :has_definition "An ectodermal dysplasia syndrome that is characterized by signs of ectodermal dysplasia (sparse hair, abnormal or missing teeth, decrease or absent sudation), typical facial features (protruding forehead, wrinkles under the eyes, characteristic periorbital hyperpigmentation), and immunodeficiency." ;
    :has_exact_synonym "Anhidrotic ectodermal dysplasia with immune deficiency",
        "Ectodermal dysplasia, hypohidrotic, with immune deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectodermal_dysplasia_and_immunodeficiency_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_immune_system_physiology ],
        :ectodermal_dysplasia_and_immune_deficiency,
        :x_linked_recessive_disease ;
    :has_definition "An ectodermal dysplasia and immunodeficiency that is characterized by onset of recurrent severe infections due to immunodeficiency in early infancy or in the first years of life and that has_material_basis_in hemizygous mutation in the IKK-gamma gene (IKBKG) on chromosome Xq28." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectodermal_dysplasia_and_immunodeficiency_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_immune_system_physiology ],
        :autosomal_dominant_disease,
        :ectodermal_dysplasia_and_immune_deficiency ;
    :has_definition "An ectodermal dysplasia and immunodeficiency that is characterized by variable features of ectodermal dysplasia (e.g., hypo/anhidrosis, sparse hair, tooth anomalies) and various immunologic and infectious phenotypes of differing severity and that has_material_basis_in heterozygous mutation in the NFKBIA gene on chromosome 14q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_t_6_9_p23_q34_1_ rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia associated with t(6;9)(p23;q34), resulting in DEK-NUP214(CAN) fusion protein expression. It is often associated with multilineage dysplasia and basophilia." ;
    :has_exact_synonym "Acute Myeloid Leukemia with t(6;9) (p23;q34.1); DEK-NUP214",
        "DEK-NUP214",
        "acute myeloid leukemia with t(6;9)(p23;q34)" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_promyelocytic_leukemia_with_pml_rara rdfs:subClassOf :acute_promyelocytic_leukemia ;
    :has_definition "An acute promyelocytic leukemia that is characterized by a severe coagulopathy and the t(15;17)(q24;q21), generating a PML-RARA fusion gene, and where abnormal promyelocytes predominate." ;
    :has_exact_synonym "acute promyelocytic leukemia, t(15;17)(q22;q11-12)" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myelomonocytic_leukemia rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by the proliferation of both neutrophil and monocyte precursors." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_inv_3_q21_3_q26_2_or_t_3_3_q21_3_q26_2_ rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia associated with inv(3)(q21q26.2) or t(3;3)(q21;q26.2), resulting in the expression of RPN1-EVI1 fusion protein and the reposition of a distal GATA2 enhancer to activate MECOM expression." ;
    :has_exact_synonym "Acute Myeloid Leukemia with inv(3) (q21.3;q26.2) or t(3;3) (q21.3;q26.2); GATA2, MECOM",
        "Acute myeloid leukemia with inv(3)(q21;q26.2) or t(3;3)(q21;q26.2); RPN1-EVI1" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_inv_16_p13_1q22_or_t_16_16_p13_1_q22_ rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by the presence of abnormal bone marrow eosinophils and the characteristic cytogenetic abnormality inv(16)(p13.1q22) or t(16;16)(p13.1;q22), which results in the expression of the fusion protein CBFB-MYH11." ;
    :has_exact_synonym "Acute Myeloid Leukemia with inv(16)(p13.1q22) or t(16;16)(p13.1;q22); CBFB-MYH11",
        "acute myeloid leukemia with abnormal marrow eosinophils" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_minimal_differentiation rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia in which the blasts do not show evidence of myeloid differentiation by morphology and conventional cytochemistry." ;
    :has_exact_synonym "AML-M0",
        "Acute myeloid leukemia, minimal differentiation" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_without_maturation rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by blasts without evidence of significant maturation in the neutrophilic lineage." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_maturation rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia characterized by blasts with evidence of significant maturation in the neutrophilic lineage." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_myelogenous_leukemia_bcr_abl1_positive rdfs:subClassOf :chronic_myeloid_leukemia ;
    :has_definition "A chronic myeloid leukemia that is characterized by an abnormally high number of neutrophils and the expression of the BCR-ABL1 fusion gene." ;
    :has_exact_synonym "Chronic myelogenous leukemia, BCR/ABL positive" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_mutated_npm1 rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia with mutation of the nucleophosmin gene. It is usually associated with normal karyotype and frequently has myelomonocytic or monocytic features." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_biallelic_mutation_of_cebpa rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia with double mutations of the CEBPA gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_mutated_runx1 rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia that is characterized by de novo RUNX1 gene mutation, not associated with myelodysplastic syndrome-related cytogenetic abnormalities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_myelodysplasia_related_changes rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia with at least 20% blasts in the bone marrow or blood and one of the following: a previous history of myelodysplastic syndrome; multilineage dysplasia; or myelodysplastic syndrome-related cytogenetic abnormalities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_t_8_21_q22_q22_1_ rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia associated with t(8;21)(q22;q22) resulting in RUNX1-RUNX1T1 fusion protein expression. The bone marrow and the peripheral blood show large myeloblasts with abundant basophilic cytoplasm, often containing azurophilic granules." ;
    :has_exact_synonym "Acute Myeloid Leukemia with t(8;21); (q22; q22.1); RUNX1-RUNX1T1",
        "acute myeloid leukemia, t(8;21)(q22;q22)" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_mll_rearrangement rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia characterized by rearrangement of the MLL (mixed-lineage leukemia) gene." ;
    :has_exact_synonym "Acute Myeloid Leukemia with KMT2A/MLL Rearrangement",
        "acute myeloid leukemia, 11q23 abnormalities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_mutated_cebpa rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia with non-germline mutations of the CEBPA gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_myeloid_leukemia_with_t_1_22_p13_q13_ rdfs:subClassOf :acute_myeloid_leukemia ;
    :has_definition "An acute myeloid leukemia typically showing megakaryocytic maturation and associated with t(1;22)(p13;q13), resulting in the expression of RBM15-MKL1 fusion protein." ;
    :has_exact_synonym "Acute Myeloid Leukemia (Megakaryoblastic) with t(1;22)(p13.3;q13.1); RBM15-MKL1" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rafiq_syndrome rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by variably impaired intellectual and motor development, a characteristic facial dysmorphism, truncal obesity, and hypotonia and that has_material_basis_in homozygous mutation in the MAN1B1 gene on chromosome 9q34." ;
    :has_exact_synonym "MENTAL RETARDATION, AUTOSOMAL RECESSIVE 15" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_13 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the TRAPPC9 gene on chromosome 8q24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_brain_abnormalities_poor_growth_and_dysmorphic_facies rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by global developmental delay with delayed walking, impaired intellectual development, and speech delay apparent from infancy or early childhood and that has_material_basis_in homozygous mutation in the ADAT3 gene on chromosome 19p13." ;
    :has_exact_synonym "autosomal recessive mental retardation 36" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_paraplegia_with_deafness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :hereditary_spastic_paraplegia,
        :x_linked_recessive_disease ;
    :has_definition "A hereditary spastic paraplegia that is characterized spastic paraplegia, tremor, cataracts, deafness, short stature, and hypogonadism presenting in the end of the first decade of life." ;
    :has_exact_synonym "Spastic paraparesis-deafness syndrome",
        "Wells Jankovic Syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonautoimmune_hyperthyroidism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hyperthyroidism ;
    :has_definition "A hyperthyroidism that is characterized by passive transfer of maternal autoantibodies and that has_material_basis_in heterozygous mutation in the thyroid-stimulating hormone receptor gene (TSHR) on chromosome 14q31." ;
    :has_exact_synonym "Congenital nonautoimmune hyperthyroidism" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_gestational_hyperthyroidism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hyperthyroidism ;
    :has_definition "A hyperthyroidism that is characterized by promiscuous stimulation of the thyrotropin receptor by the excess chorionic gonadotropin and that has_material_basis_in heterozygous mutation in the gene encoding the thyroid-stimulating hormone receptor (TSHR) on chromosome 14q31." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_water_epilepsy rdfs:subClassOf :reflex_epilepsy ;
    :has_definition "A reflex epilepsy that is characterized by seizures triggered by the stimulus of bathing with hot water poured over the head." ;
    :has_exact_synonym "bathing epilepsy",
        "water immersion epilepsy" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:keratosis_palmoplantaris_striata rdfs:subClassOf :palmoplantar_keratosis ;
    :has_definition "A palmoplantar keratosis that is characterized by hyperkeratotic lesions that are restricted to the pressure regions extending longitudinally in the length of each finger to the palm." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_water_epilepsy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hot_water_epilepsy ;
    :has_definition "A hot water epilepsy that has_material_basis_in a susceptibility locus for hot water epilepsy (HWE1) mapped to chromosome 10q21.3-q22.3." ;
    :has_exact_synonym "Hot Water Epilepsy, 1" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_water_epilepsy_2 rdfs:subClassOf :hot_water_epilepsy ;
    :has_definition "A hot water epilepsy that has_material_basis_in linkage to chromosome 4q24-q28." ;
    :has_exact_synonym "Hot Water Epilepsy, 2" .

