    :has_definition "An inclusion body myopathy with Paget disease of bone and frontotemporal dementia that is characterized by proximal limb girdle muscle weakness affecting the lower and upper limbs and resulting in gait difficulties and scapular winging and that has_material_basis_in heterozygous mutation in the ANXA11 gene on chromosome 10q22." ;
    :has_exact_synonym "multisystem proteinopathy 6" .

