    :has_definition "A craniofacial dysmorphism, skeletal anomalies, and mental retardation syndrome that is characterized by flat face, low-set ears, and cleft lip and palate, as well as costovertebral anomalies including bifid and fused ribs, vertebral segmentation defects, and scoliosis. Intellectual delay can be severe, with absent speech and that has_material_basis_in homozygous mutation in the RAB5IF gene on chromosome 20q11." .

