            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by global developmental delay apparent in infancy or early childhood and associated with characteristic dysmorphic facial features, such as broad forehead, depressed nasal bridge with bulbous nasal tip, and deep-set eyes and that has_material_basis_in heterozygous mutation in the WAC gene on chromosome 10p11 or deletion at chromosome 10p12-p11." ;
    :has_exact_synonym "Chromosome 10p12-p11 deletion syndrome",
        "Facial dysmorphism-developmental delay-behavioral abnormalities syndrome due to 10p11.21p12.31 microdeletion",
