    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by intellectual impairment, macrocephaly, and dysmorphic features and that has_material_basis_in homozygous mutation in the APC2 gene on chromosome 19p13. Epilepsy with eyelid myoclonus has also been reported." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_57 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the MBOAT7 gene on chromosome 19q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_58 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous or compound heterozygous mutation in the ELP2 gene on chromosome 18q12." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_59 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the IMPA1 gene on chromosome 8q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_60 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the TAF13 gene on chromosome 1p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycosylphosphatidylinositol_biosynthesis_defect_16 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous or compound heterozygous mutation in the PIGC gene on chromosome 1q23." ;
    :has_exact_synonym "Intellectual developmental disorder, autosomal recessive 62" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_63 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the CAMK2A gene on chromosome 5q32." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_64 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the LINGO1 gene on chromosome 15q24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_65 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
