@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_66 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by delayed speech development, neuropsychiatric symptoms, and relatively normal life span and that has_material_basis_in homozygous mutation in the C12ORF4 gene on chromosome 12p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_67 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation or compound heterozygous mutation in the EIF3F gene on chromosome 11p15." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_68 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the TRMT1 gene on chromosome 19p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_69 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the ZBTB11 gene on chromosome 3q12." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_70 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized primarily by impaired intellectual developmen and that has_material_basis_in homozygous mutation in the RSRC1 gene on chromosome 3q25." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_71 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the ALKBH8 gene on chromosome 11q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_73 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by global developmental delay with hypotonia and mildly delayed walking, impaired intellectual development with poor or absent speech, and mildly dysmorphic features and that has_material_basis_in homozygous mutation in the NAA20 gene on chromosome 20p11." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_75 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by global developmental delay apparent from infancy or early childhood and moderate to profoundly impaired intellectual development and that has_material_basis_in homozygous mutation in the PIDD1 gene on chromosome 11p15." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_76 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that has_material_basis_in homozygous mutation in the GRIA1 gene on chromosome 5q33." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_intellectual_developmental_disorder_77 rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by global developmental delay with variably impaired cognitive development apparent from infancy and that has_material_basis_in homozygous mutation in the CEP104 gene on chromosome 1p36." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acromesomelic_dysplasia_3 rdfs:subClassOf :acromesomelic_dysplasia ;
    :has_definition "An acromesomelic dysplasia that has_material_basis_in homozygous mutation in the BMPR1B gene on chromosome 4q22." ;
    :has_exact_synonym "Demirhan-type acromesomelic dysplasia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acromesomelic_dysplasia_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :acromesomelic_dysplasia,
        :autosomal_recessive_disease ;
    :has_definition "An acromesomelic dysplasia that is characterized by disproportionate short stature due to mesomelic shortening of the limbs and that has_material_basis_in homozygous mutation in the PRKG2 gene on chromosome 4q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:injection_anthrax rdfs:subClassOf :anthrax_disease ;
    :has_definition "An anthrax disease that is characterized by infection at the injection site or deep under the skin or in the muscle where the drug was injected and is caused by heroin contaminated with anthrax spores." ;
    :has_exact_synonym "injectional anthrax",
        "injectional anthrax syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peroxisome_biogenesis_disorder_1b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :peroxisomal_biogenesis_disorder ;
    :has_definition "A peroxisome biogenesis disorder that is characterized by the overlapping phenotypes of neonatal adrenoleukodystrophy and infantile Refsum disease and that has_material_basis_in homozygous or compound heterozygous mutation in the PEX1 gene on chromosome 7q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peroxisome_biogenesis_disorder_3b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :peroxisomal_biogenesis_disorder ;
    :has_definition "A peroxisome biogenesis disorder that has_material_basis_in homozygous or compound heterozygous mutation in the PEX12 gene on chromosome 17." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autoimmune_interstitial_lung_joint_and_kidney_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :interstitial_lung_disease ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autoimmune_disease,
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by interstitial lung disease, inflammatory arthritis, and immune complex-mediated renal disease and that has_material_basis_in heterozygous mutation in the COPA gene on chromosome 1q23." ;
    :has_exact_synonym "Autoimmune interstitial lung disease-arthritis syndrome",
        "COPA syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhizomelic_chondrodysplasia_punctate_type_4 rdfs:subClassOf :rhizomelic_chondrodysplasia_punctata ;
    :has_definition "A rhizomelic chondrodysplasia punctate that has_material_basis_in homozygous or compound heterozygous mutation in the FAR1 gene on chromosome 11p15, which is required for the conversion of fatty acyl-CoAs to fatty alcohols, causing reduction or complete loss of FAR1 activity result in peroxisomal FAR1 deficiency." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pituitary_blastoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :non_terminally_differentiated_cell ],
        :blastoma,
        :pituitary_cancer ;
    :has_definition "A pituitary cancer that is characterized by features of Cushing disease, with elevated blood ACTH levels and hypercortisolism arising within the fetal anterior pituitary and associated with DICER1 mutations." ;
    :has_exact_synonym "Pituitary Gland Blastoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cauda_equina_neuroendocrine_tumor rdfs:subClassOf :cauda_equina_neoplasm ;
    :has_definition "A cauda equina neoplasm that is a slow-growing, well-differentiated neuroendocrine tumor arising from the cauda equina." ;
    :has_exact_synonym "Cauda equina neuroendocrine tumour",
        "Spinal neuroendocrine tumors" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:teratoma_with_somatic_type_malignancy rdfs:subClassOf :teratoma ;
    :has_definition "A teratoma that is characterized by morphologic transformation to malignancy and an aggressive clinical course." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dedifferentiated_chondrosarcoma rdfs:subClassOf :chondrosarcoma ;
    :has_definition "A chondrosarcoma that is an aggressive morphologic variant of chondrosarcoma. It is composed of a low grade chondrosarcoma and a high grade non-cartilagenous sarcomatous component." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pineocytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pineal_body ],
        :endocrine_organ_benign_neoplasm ;
    :has_definition "An endocrine organ benign neoplasm arising from the pineal gland that is composed of small, uniform, mature cells resembling pineocytes with occasional large pineocytomatous rosettes. It may show a wide range of divergent phenotypes, including neuronal, glial, melanocytic, photoreceptor and mesenchymal differentiation." ;
    :has_exact_synonym "Pinealocytoma",
        "Pinealoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ewsr1_negative_small_round_cell_tumor rdfs:subClassOf :small_cell_sarcoma ;
    :has_definition "A small cell sarcoma that is characterized by the absence of EWSR1 rearrangement and the presence of small round malignant cells with a small amount of cytoplasm." ;
    :has_exact_synonym "EWSR1-Negative Small Blue Round Cell Tumor" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cic_rearranged_sarcoma rdfs:subClassOf :ewsr1_negative_small_round_cell_tumor ;
    :has_definition "An EWSERI-negative small round cell tumor that is characterized by a recurrent translocation involving the CIC gene on chromosome 19 and either DUX4 gene on chromosome 4 or DUX4L gene on chromosome 10. The translocation results in either CIC-DUX4, t(4;19)(q35;q13) or CIC-DUX4L, t(10;19)(q26;q13) fusions." ;
    :has_exact_synonym "Capicua transcriptional repressor (CIC)-rearranged sarcoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:papillary_tumor_of_the_pineal_region rdfs:subClassOf :pineal_gland_cancer ;
    :has_definition "A pineal gland cancer that is characterized by the presence of neuroepithelial cells and a papillary architecture." ;
    :has_exact_synonym "Papillary tumour of the pineal region" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supratentorial_ependymoma_zfta_fusion_positive rdfs:subClassOf :supratentorial_ependymoma ;
    :has_definition "A suptratentorial ependymoma that is characterized by the presence of a fusion gene involving ZFTA gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supratentorial_ependymoma_yap1_fusion_positive rdfs:subClassOf :supratentorial_ependymoma ;
    :has_definition "A supratentorial ependymoma that is characterized by the presence of a fusion gene involving YAP1 gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:posterior_fossa_group_a_ependymoma rdfs:subClassOf :posterior_fossa_ependymoma ;
    :has_definition "A posterior fossa ependymoma that arises in the posterior fossa with characteristic DNA methylation patterns, including CpG island hypermethylation, global DNA hypomethylation, reduction of nuclear H3 p.K28me3 (K27me3) expression, and EZHIP overexpression." ;
    :has_exact_synonym "Posterior Fossa Ependymoma, Group A (PFA)",
        "Posterior fossa group A (PFA) ependymoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:posterior_fossa_group_b_ependymoma rdfs:subClassOf :posterior_fossa_ependymoma ;
    :has_definition "A posterior fossa ependymoma that arises in the posterior fossa with characteristic DNA methylation patterns including retention of nuclear H3 p.K28me3 (K27me3) expression, absence of CpG island hypermethylation, absence of global DNA hypomethylation, and absence of EZHIP overexpression." ;
    :has_exact_synonym "Posterior Fossa Ependymoma, Group B (PFB)",
        "Posterior fossa group B (PFB) ependymoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astrocytoma_idh_mutant_grade_2 rdfs:subClassOf :idh_mutant_anaplastic_astrocytoma ;
    :has_definition "An IDH-mutant anaplastic astrocytoma that is characterized by the presence of well-differentiated fibrillary glial cells diffusely infiltrating the central nervous system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astrocytoma_idh_mutant_grade_3 rdfs:subClassOf :idh_mutant_anaplastic_astrocytoma ;
    :has_definition "An IDH-mutant anaplastic astrocytoma that is characterized by the presence of increased mitotic activity and anaplastic features." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desmoplastic_infantile_ganglioglioma_desmoplastic_infantile_astrocytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :ganglioglioma ;
    :has_definition "A ganglioglioma occurring predominantly in the cerebral hemispheres of infants, that are driven by MAPK pathway activation and composed of a mixed astrocytic and neuronal component (DIG) or an astrocytic component only (DIA) embedded in an extensive desmoplastic stroma, often containing foci of undifferentiated embryonal-like tumour cells." ;
    :has_exact_synonym "Desmoplastic Infantile Astrocytoma",
        "desmoplastic infantile ganglioglioma",
        "desmoplastic infantile ganglioglioma and desmoplastic infantile astrocytoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_low_grade_glioma_mapk_pathway_altered rdfs:subClassOf :low_grade_glioma ;
    :has_definition "A low grade glioma that is characterized by a gene alteration that results in a MAPK pathway abnormality, with morphological features of astrocytoma or oligodendroglioma." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:angiocentric_glioma rdfs:subClassOf :low_grade_glioma ;
    :has_definition "A low grade glioma that is characterized by an angiocentric pattern, monomorphic cellular infiltrate, and ependymal differentiation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intellectual_developmental_disorder_with_hypotonia_impaired_speech_and_dysmorphic_facies rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by global developmental delay with impaired intellectual development and poor or absent speech, hypotonia, ophthalmologic abnormalities, and nonspecific dysmorphic features, and that has_material_basis_in heterozygous mutation in the TNPO2 gene on chromosome 19p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_microcephaly_cataracts_and_renal_abnormalities rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by global developmental delay, microcephaly, cataracts, and renal abnormalities and that has_material_basis_in homozygous mutation of the GEMIN4 gene on chromosome 17p13." ;
    :has_exact_synonym "NEDMCR syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_delay_hypotrophy_and_dysmorphic_features_without_moebius_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by developmental delay, hypotrophy, and dysmorphic features and that has_material_basis_in homozygous ultra-rare REV3L variant (T2753R)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intellectual_developmental_disorder_with_abnormal_behavior_microcephaly_and_short_stature rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by abnormal behavior, microcephaly, and short stature and that has_material_basis_in homozygous mutation in the PUS7 gene on chromosome 7q22." ;
    :has_exact_synonym "IDDBAS" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pachygyria_microcephaly_developmental_delay_and_dysmorphic_facies_with_or_without_seizures rdfs:subClassOf :lissencephaly ;
    :has_definition "A lissencephaly that is characterized by progressive microcephaly associated with abnormal facial features, hypotonia, and variable global developmental delay with impaired intellectual development and that has_material_basis_in homozygous or compound heterozygous mutation in the TUBGCP2 gene on chromosome 10q26." ;
    :has_exact_synonym "PAMDDFS" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:graft_versus_host_disease rdfs:subClassOf :immune_system_disease ;
    :has_definition "An immune system disease that is characterized by recognition by mature donor T cells, that contaminate the allogeneic bone marrow, of the recipient's tissue as foreign, causing a severe inflammatory disease characterized by rashes, diarrhea, and liver disease, and that has_material_basis_in an associated with variation in the interleukin-10 gene (IL10) on chromosome 1q32." ;
    :has_exact_synonym "GvHD",
        "graft versus host disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_venoocclusive_disease_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :pulmonary_venoocclusive_disease ;
    :has_definition "A pulmonary venoocclusive disease that has_material_basis_in heterozygous mutation in the BMPR2 gene on chromosome 2q33." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_venoocclusive_disease_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :pulmonary_venoocclusive_disease ;
    :has_definition "A pulmonary venoocclusive disease that has_material_basis_in homozygous or compound heterozygous mutation in the EIF2AK4 gene on chromosome 15q15 and that is characterized histologically by widespread fibrous intimal proliferation of septal veins and preseptal venules, and is frequently associated with pulmonary capillary dilatation and proliferation." ;
    :has_exact_synonym "FAMILIAL PULMONARY CAPILLARY HEMANGIOMATOSIS" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smith_mc_cort_dysplasia_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :smith_mc_cort_dysplasia ;
    :has_definition "A Smith-McCort dysplasia that is characterized by short limbs and a short trunk with a barrel-shaped chest and has_material_basis_in homozygous or compound heterozygous mutation in the DYM gene (607461) on chromosome 18q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smith_mc_cort_dysplasia_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :smith_mc_cort_dysplasia ;
    :has_definition "A Smith-McCort dysplasia that is characterized by short trunk dwarfism with a barrel-shaped chest, rhizomelic limb shortening and that has_material_basis_in homozygous or compound heterozygous mutation in the RAB33B gene on chromosome 4q31." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sandestig_stefanova_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :loss_of_function_variant ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by microcephaly, trigonocephaly, congenital cataracts, microphthalmia, facial findings, camptodactyly, periventricular white matter loss, thin corpus callosum, delayed myelination, and poor prognosis and that has_material_basis_in homozygous mutation in the NUP188 gene on chromosome 9q34." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:siddiqi_syndrome rdfs:subClassOf :lipid_storage_disease ;
    :has_definition "A lipid storage disease that is characterized by global developmental delay, early-onset progressive sensorineural hearing impairment, regression of motor skills, dystonia, poor overall growth, and low body mass index and that has_material_basis_in homozygous or compound heterozygous mutation in the FITM2 gene on chromosome 20q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peroxisome_biogenesis_disorder_14b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :peroxisomal_biogenesis_disorder ;
    :has_definition "A peroxisome biogenesis disorder that is characterized clinically by mild intellectual disability, congenital cataracts, progressive hearing loss, and polyneuropathy and that has_material_basis_in homozygous mutation in the PEX11B gene on chromosome 1q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_eye_movement_abnormalities_and_ataxia rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by global developmental delay apparent from infancy and that has_material_basis_in heterozygous mutation in the FRMD5 gene on chromosome 15q15. Affected individuals show delayed walking with an unsteady gait, variably impaired intellectual development, learning disabilities, and speech difficulties." ;
    :has_exact_synonym "NEDEMA" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellar_atrophy_visual_impairment_and_psychomotor_retardation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_delay ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by cerebellar atrophy, visual impairment and psychomotor retardation and that has_material_basis_in homozygous mutation in the EMC1 gene on chromosome 1p36." ;
    :has_exact_synonym "CAVIPMR" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_pediatric_type_high_grade_glioma_h3_wildtype_and_idh_wildtype rdfs:subClassOf :high_grade_glioma ;
    :has_definition "A high grade glioma that is characterized by the absence of histone H3, IDH1, and IDH2 mutations." ;
    :has_exact_synonym "diffuse paediatric-type high-grade glioma, H3-wildtype and IDH-wildtype" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infant_type_hemispheric_glioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebral_hemisphere ],
        :malignant_astrocytoma ;
    :has_definition "A malignant astrocytoma that is characterized by receptor tyrosine kinase fusions in the NTRK family, ROS1, ALK, or MET genes, that arises in the cerebral hemisphere and occurs in early childhood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_astrocytoma_myb_or_mybl1_altered rdfs:subClassOf :diffuse_astrocytoma ;
    :has_definition "A diffuse astrocytoma that is a diffusely infiltrative astroglial neoplasm composed of monomorphic cells with genetic alterations in MYB or MYBL1." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pituicytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :neurohypophysis ],
        :posterior_pituitary_gland_neoplasm ;
    :has_definition "A posterior pituitary gland neoplasm that is characterized by the presence of elongated, spindle-shaped neoplastic glial cells that form storiform patterns or interlacing fascicular arrangements." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oligodendroglioma_idh_mutant_and_1p_19q_codeleted_grade_2 rdfs:subClassOf :idh_mutant_and_1p_19q_codeleted_oligodendroglioma ;
    :has_definition "An IDH-mutant, and 1p/19q-codeleted oligodendroglioma that is characterized as a well differentiated tumor lacking anaplastic features (brisk mitotic activity, microvascular proliferation, necrosis)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oligodendroglioma_idh_mutant_and_1p_19q_codeleted_grade_3 rdfs:subClassOf :idh_mutant_and_1p_19q_codeleted_oligodendroglioma ;
    :has_definition "An IDH-mutant, and 1p/19q-codeleted oligodendroglioma that is characterized as grade 3 tumors associated with a more rapid growth. Grade 3 tumors appear to have abnormalities on chromosomes 9 or 10, along with unusual amounts of growth factors and proteins, which are thought to contribute to the more rapid growth of these gliomas." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:papillary_glioneuronal_tumor rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is characterized by the presence of astrocytes that line vascular and hyalinized pseudopapillae." ;
    :has_exact_synonym "Papillary glioneuronal tumour" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rosette_forming_glioneuronal_tumor rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is characterized by the presence of neurocytes forming pseudorosettes and astrocytes which contain Rosenthal fibers." ;
    :has_exact_synonym "RGNT",
        "Rosette-forming glioneuronal tumour" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myxoid_glioneuronal_tumor rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is characterized by a dinucleotide mutation at codon 385 of the PDGFR gene. It usually occurs in the septum pellucidum but has also been described in the corpus callosum and periventricular white matter of the lateral ventricle. It is composed of oligodendrocyte-like cells in a prominent myxoid stroma." ;
    :has_exact_synonym "Myxoid glioneuronal tumour" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:embryonal_tumor_with_multilayered_rosettes rdfs:subClassOf :central_nervous_system_embryonal_tumor ;
    :has_definition "A central nervous system embryonal tumor that is characterized by the presence of multilayered rosette formation and typically the presence of amplification of the C19MC region on chromosome 19 (19q13.42) or rarely a DICER1 mutation." ;
    :has_exact_synonym "Embryonal tumour with multilayered rosettes" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:white_sponge_nevus_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :white_sponge_nevus ;
    :has_definition "A white sponge nevus that has_material_basis_in heterozygous mutation in the keratin-4 gene (KRT4) on chromosome 12q13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:white_sponge_nevus_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :white_sponge_nevus ;
    :has_definition "A white sponge nevus that has_material_basis_in heterozygous mutation in the KRT13 gene on chromosome 17q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:antley_bixler_syndrome rdfs:subClassOf :craniosynostosis ;
    :has_definition "A craniosynostosis that is characterized by radiohumeral synostosis present from the perinatal period." ;
    :has_exact_synonym "Antley Bixler syndrome",
        "Antley and Bixler's syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:antley_bixler_syndrome_without_disordered_steroidogenesis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :antley_bixler_syndrome,
        :autosomal_dominant_disease ;
    :has_definition "An Antley-Bixler syndrome that has_material_basis_in heterozygous mutation in a fibroblast growth factor receptor gene, FGFR2, on chromosome 10q26 and is an exclusively skeletal form of Antley-Bixler syndrome." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_traumatic_encephalopathy rdfs:subClassOf :tauopathy ;
    :has_definition "A tauopathy that is characterized by an abundance of hyperphosphorylated tau protein in neurons, astrocytes and cell processes around blood vessels and that is associated with repetitive head impacts or exposure to blast waves." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:traumatic_brain_injury rdfs:subClassOf :brain_disease ;
    :has_definition "A brain disease that is characterized by brain dysfunction caused by an outside force, usually a violent blow to the head." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salivary_gland_mucoepidermoid_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :saliva_secreting_gland ] ;
                            rdf:rest :nil ] ] ],
        :mucoepidermoid_carcinoma,
        :salivary_gland_carcinoma ;
    :has_definition "A mucoepidermoid carcinoma located_in the salivary gland." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuronal_intranuclear_inclusion_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :neurodegenerative_disease ;
    :has_definition "A neurodegenerative disease that is characterized by a wide range of clinical manifestations, including pyramidal and extrapyramidal symptoms, cerebellar ataxia, cognitive decline and dementia, peripheral neuropathy, and autonomic dysfunction, and that has_material_basis_in heterozygous repeat expansion (CGG) in the 5-prime untranslated region of the NOTCH2NLC gene on chromosome 1q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:essential_tremor_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :essential_tremor ;
    :has_definition "An essential tremor that is characterized by adult-onset kinetic and/or postural tremor usually affecting the upper limbs and that has_material_basis_in heterozygous trinucleotide GGC repeat expansion in the 5-prime untranslated region of the NOTCH2NLC gene on chromosome 1q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculopharyngodistal_myopathy rdfs:subClassOf :myopathy ;
    :has_definition "A myopathy that is characterized by progressive external ocular, facial and pharyngeal muscle weakness, leading to variable degrees of ptosis, ophthalmoparesis, facial muscle atrophy, dysarthria and dysphagia, as well as distal muscle weakness and atrophy of lower and upper extremities." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculopharyngodistal_myopathy_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :oculopharyngodistal_myopathy ;
    :has_definition "An oculopharyngodistal myopathy that is characterized by adult-onset ptosis, external ophthalmoplegia, facial muscle weakness, distal limb muscle weakness and atrophy, and pharyngeal involvement, resulting in dysphagia and dysarthria, and that has_material_basis_in heterozygous trinucleotide repeat expansion (CGG) in the 5-prime untranslated region of the LRP12 gene on chromosome 8q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculopharyngodistal_myopathy_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        :autosomal_dominant_disease,
        :oculopharyngodistal_myopathy ;
    :has_definition "An oculopharyngodistal myopathy that is characterized by onset of distal muscle weakness, mainly of the lower limbs, and/or ophthalmoplegia in the second or third decades of life, and that has_material_basis_in heterozygous trinucleotide repeat expansion (GGC(n)) in the 5-prime untranslated region (UTR) of the GIPC1 gene on chromosome 19p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculopharyngodistal_myopathy_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :oculopharyngodistal_myopathy ;
    :has_definition "An oculopharyngodistal myopathy that is characterized by progressive muscle weakness with ocular, facial, pharyngeal, and distal limb involvement, resulting in dysarthria and gait difficulties and that has_material_basis_in heterozygous trinucleotide repeat expansion (CGG) in the 5-prime untranslated region (UTR) of the NOTCH2NLC gene on chromosome 1q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculopharyngodistal_myopathy_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        :autosomal_dominant_disease,
        :oculopharyngodistal_myopathy ;
    :has_definition "An oculopharyngodistal myopathy that is characterized by progressive ptosis, ophthalmoparesis, facial and masseter weakness, and muscle weakness of the distal limbs and that has_material_basis_in heterozygous trinucleotide repeat expansion (CGG) in the 5-prime untranslated region (UTR) of the RILPL1 gene on chromosome 12q24." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intellectual_developmental_disorder_with_ocular_anomalies_and_distinctive_facial_features rdfs:subClassOf :syndromic_intellectual_disability ;
    :has_definition "A syndromic intellectual disability that is characterized by global developmental delay, mildly impaired intellectual development, ophthalmologic anomalies, microcephaly or relative microcephaly, hearing loss, and characteristic facial features, and that has_material_basis_in heterozygous mutation in the MTSS2 gene on chromosome 16q22." ;
    :has_exact_synonym "IDDOF",
        "MTSS2-related neurodevelopmental disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_leptomeningeal_glioneuronal_tumor rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is characterized by the presence of clear glial neoplastic cells reminiscent of oligodendroglioma." ;
    :has_exact_synonym "Diffuse leptomeningeal glioneuronal tumour" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multinodular_and_vacuolating_neuronal_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebral_hemisphere ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :middle_age_onset ],
        :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is composed of cells with glial and/or neuronal differentiation forming multiple nodules with prominent vacuolation and that affecting the cerebral hemispheres." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:high_grade_astrocytoma_with_piloid_features rdfs:subClassOf :anaplastic_astrocytoma ;
    :has_definition "An anaplastic astrocytoma that is characterized by high-grade piloid and/or glioblastoma-like histological features. It may occur anywhere in the central nervous system but most often arises in the posterior fossa." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polymorphous_low_grade_neuroepithelial_tumour_of_the_young rdfs:subClassOf :central_nervous_system_benign_neoplasm ;
    :has_definition "A central nervous system benign neoplasm that is characterized by the presence of oligodendroglioma-like components, may also contain astrocytic components and is associated with seizures and in many cases refractory epilepsy." ;
    :has_exact_synonym "Polymorphous low-grade neuroepithelial tumour of the young",
        "Massively Calcified Low Grade Glioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spindle_cell_oncocytoma rdfs:subClassOf :posterior_pituitary_gland_neoplasm ;
    :has_definition "A posterior pituitary benign neoplasm that is characterized by the presence of spindle cells with eosinophilic, granular cytoplasm forming fascicles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphomatoid_granulomatosis rdfs:subClassOf :lymphoproliferative_syndrome ;
    :has_definition "A lymphoproliferative syndrome that is characterized by overproduction (proliferation) of white blood cells called lymphocytes. The abnormal cells infiltrate and accumulate (form lesions or nodules) within tissues. The lesions or nodules damage or destroy the blood vessels within these tissues." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grade_i_lymphomatoid_granulomatosis rdfs:subClassOf :lymphomatoid_granulomatosis ;
    :has_definition "A lymphomatoid granulomatosis that is characterized by the presence of a polymorphous lymphoid infiltrate without cytologic atypia. Large lymphocytes are absent or rare. By in situ hybridization, EBV-positive cells are infrequently seen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grade_ii_lymphomatoid_granulomatosis rdfs:subClassOf :lymphomatoid_granulomatosis ;
    :has_definition "A lymphomatoid granulomatosis that is characterized by the presence of occasional large lymphoid cells or immunoblasts in a polymorphous background. Necrosis is more commonly seen as compared to grade I lymphomatoid granulomatosis. By in situ hybridization, EBV-positive cells are readily seen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grade_iii_lymphomatoid_granulomatosis rdfs:subClassOf :lymphomatoid_granulomatosis ;
    :has_definition "A lymphomatoid granulomatosis that is characterized by the presence of aggregates of neoplastic large B-lymphocytes, usually admixed with pleomorphic and Hodgkin-like cells, in a background of chronic inflammation. Necrotic changes are present and are usually extensive." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intravascular_large_b_cell_lymphoma rdfs:subClassOf :b_cell_lymphoma ;
    :has_definition "A B-cell lymphoma that is characterized by the presence of lymphoma cells exclusively in the lumina of small vessels, particularly capillaries." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t_cell_non_hodgkin_lymphoma rdfs:subClassOf :non_hodgkin_lymphoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lymphoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :t_cell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A non-Hodgkin lymphoma of T-cell lineage." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_diffuse_large_b_cell_lymphoma_of_the_central_nervous_system rdfs:subClassOf :diffuse_large_b_cell_lymphoma ;
    :has_definition "A diffuse large B-cell lymphoma arising from the central nervous system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extraventricular_neurocytoma rdfs:subClassOf :cerebral_ventricle_cancer ;
    :has_definition "A cerebral ventricle cancer that is characterized by the presence of neoplastic uniform, round cells with neuronal differentiation, that arises from the brain parenchyma. Unlike central neurocytoma, it does not involve the lateral ventricles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_tumor_with_bcor_internal_tandem_duplication rdfs:subClassOf :central_nervous_system_embryonal_tumor ;
    :has_definition "A central nervous system embryonal tumor that is characterized by the presence of uniform oval or spindle-shaped cells with round or oval nuclei, pseudorosette formation, and heterozygous internal tandem duplication in exon 15 of the BCOR gene." ;
    :has_exact_synonym "CNS tumour with BCOR internal tandem duplication" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_intracranial_sarcoma_dicer1_mutant rdfs:subClassOf :brain_sarcoma ;
    :has_definition "A brain sarcoma that is composed of malignant pleomorphic or spindle neoplastic cells typically demonstrating myogenic and/or chondroid differentiation. Cytoplasmic eosinophilic globules and myxoid stroma formation are usually present. It is associated with mutations in the DICER1 gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_synostoses_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :multiple_synostoses_syndrome ;
    :has_definition "A multiple synostoses syndrome is characterized by multiple joint fusions, usually commencing in the hands, conductive deafness, and characteristic facial features, including a broad, tubular-shaped nose and a thin upper vermilion and that has_material_basis_in heterozygous mutation in the NOG gene on chromosome 17q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_synostoses_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :multiple_synostoses_syndrome ;
    :has_definition "A multiple synostoses syndrome that is characterized by progressive joint fusions of the fingers, wrists, ankles, and cervical spine; characteristic facies, including a broad hemicylindrical nose; and progressive conductive hearing loss and that has_material_basis_in heterozygous mutation in the GDF5 gene on chromosome 20q11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_synostoses_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :multiple_synostoses_syndrome ;
    :has_definition "A multiple synostoses syndrome that is characterized by multiple joint fusions, usually commencing in the hands, conductive deafness, and characteristic facial features, including a broad, tubular-shaped nose and a thin upper vermilion and that has_material_basis_in heterozygous mutation in the FGF9 gene on chromosome 13q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_synostoses_syndrome_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :multiple_synostoses_syndrome ;
    :has_definition "A multiple synostoses syndrome that is characterized by fusion of carpal and tarsal bones, as well as conductive hearing loss and that has_material_basis_in heterozygous mutation in the GDF6 gene on chromosome 8q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:contractures_pterygia_and_spondylocarpotarsal_fusion_syndrome_1a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :contractures_pterygia_and_spondylocarpotarsal_fusion_syndrome ;
    :has_definition "A contractures, pterygia, and spondylocarpotarsal fusion syndrome that is characterized by contractures of proximal and distal joints, pterygia involving the neck, axillae, elbows, and/or knees, as well as variable vertebral, carpal, and tarsal fusions and short stature and that has material_basis_in heterozygous mutation in the MYH3 gene on chromosome 17p13." ;
    :has_exact_synonym "Autosomal dominant multiple pterygium syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:contractures_pterygia_and_spondylocarpotarsal_fusion_syndrome_1b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :contractures_pterygia_and_spondylocarpotarsal_fusion_syndrome ;
    :has_definition "A contractures, pterygia, and spondylocarpotarsal fusion syndrome that is characterized by contractures of proximal and distal joints, pterygia involving the neck, elbows, fingers, and/or knees, and variable vertebral, carpal, and tarsal fusions and that has_material_basis_in compound heterozygous mutation in the MYH3 gene on chromosome 17p13." ;
    :has_exact_synonym "Autosomal recessive multiple pterygium syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_implant_illness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :breast ],
        :breast_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by fatigue, problems with memory or concentration, joint and muscle pain, hair loss, weight changes and anxiety/depression." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_poor_growth_spastic_tetraplegia_and_hearing_loss rdfs:subClassOf :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by poor growth, spastic tetraplegia, and hearing loss and that has_material_basis_in homozygous mutation in the PSMC1 gene on chromosome 14q32." ;
    :has_exact_synonym "NEDGTH" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:developmental_and_epileptic_encephalopathy_94 rdfs:subClassOf :developmental_and_epileptic_encephalopathy ;
    :has_definition "A developmental and epileptic encephalopathy characterized by onset of multiple seizure types in the first few years of life and associated with poor prognosis and that has_material_basis_in heterozygous mutation in the CHD2 gene on chromosome 15q26." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oxoglutarate_dehydrogenase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :amino_acid_metabolic_disorder,
        :autosomal_recessive_disease ;
    :has_definition "An amino acid metabolic disorder that is characterized by infantile and pediatric onset basal ganglia-associated movement disorders, hypotonia, developmental delays, ataxia, and seizures and that has_material_basis_in homozygous mutation in the oxoglutarate dehydrogenase gene (OGDH) on chromosome 7p13." ;
    :has_exact_synonym "Oxoglutaric aciduria",
        "alpha-ketoglutarate dehydrogenase deficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_regression_abnormal_movements_loss_of_speech_and_seizures rdfs:subClassOf :neurodegenerative_disease ;
    :has_definition "A neurodegenerative disease that is characterized by neurodevelopmental regression that became apparent between 2 and 10 years of age after normal early development in most patients, although a few had mild early delays and that has_material_basis_in heterozygous mutation in the IRF2BPL gene on chromosome 14q24." ;
    :has_exact_synonym "NEDAMSS" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_hyperinsulinemic_hypoglycemia_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_blood_glucose_concentration ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hyperinsulinemic_hypoglycemia ;
    :has_definition "A hyperinsulinemic hypoglycemia characterized by protein-related hypoglycemia and persistent mild hyperammonemia and that has_material_basis_in homozygous mutation in the SLC25A36 gene on chromosome 3q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_storage_disease_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :glycogen_storage_disease ;
    :has_definition "A glycogen storage disease that is characterized by severe hypoglycemia and hepatomegaly caused by the accumulation of glycogen. Affected individuals exhibit growth retardation, delayed puberty, lactic acidemia, hyperlipidemia, hyperuricemia, and in adults a high incidence of hepatic adenomas." ;
    :has_exact_synonym "Glycogen storage disease 1",
        "deficiency of glucose-6-phosphatase",
        "glycogen storage disease type I",
        "glycogenosis type I",
        "von Gierke disease",
        "von Gierke's disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_storage_disease_ib rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :glycogen_storage_disease_i ;
    :has_definition "A glycogen storage disease I that has_material_basis_in homozygous or compound heterozygous mutation in the G6PT1 gene (SLC37A4), which encodes glucose-6-phosphate translocase, on chromosome 11q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_storage_disease_ic rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :glycogen_storage_disease_i ;
    :has_definition "A glycogen storage disease I that has_material_basis_in homozygous or compound heterozygous mutation in the G6PT1 gene (SLC37A4), which encodes glucose-6-phosphate translocase, on chromosome 11q23. G6PT1 is also the site of the defect in glycogen storage disease Ib." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:progeroid_syndrome rdfs:subClassOf :syndrome ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_phenotype ;
                                    owl:someValuesFrom :prematurely_aged_appearance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A syndrome that is characterized by the premature onset of age-related pathologies." ;
    :has_exact_synonym "progeroid disease",
        "progeroid syndromes" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wiedemann_rautenstrauch_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :neonatal_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :progeroid_syndrome ;
    :has_definition "A progeroid syndrome that is characterized by intrauterine growth retardation, failure to thrive, short stature, a progeroid appearance, hypotonia, and variable mental impairment and that has_material_basis_in compound heterozygous mutation in the POLR3A gene on chromosome 10q22." ;
    :has_exact_synonym "Neonatal progeroid syndrome",
        "PROGEROID SYNDROME, NEONATAL" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nestor_guillermo_progeria_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :autosomal_recessive_disease,
        :progeroid_syndrome ;
    :has_definition "A progeroid syndrome that is characterized by lipoatrophy, osteoporosis, and very severe osteolysis. Patients have no cardiovascular impairment, diabetes mellitus, or hypertriglyceridemia, but suffer profound skeletal abnormalities that affect their quality of life and that has_material_basis_in homozygous mutation in the BANF1 gene on chromosome 11q13. Onset is after 2 years of age." ;
    :has_exact_synonym "Progeria syndrome, childhood-onset, with osteolysis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:becker_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :myotonia_congenita ;
    :has_definition "A myotonia congenita that is characterized by muscle stiffness and an inability of the muscle to relax after voluntary contraction and that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding skeletal muscle chloride channel-1 (CLCN1) on chromosome 7q34." ;
    :has_exact_match "OMIM:255700" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thomsen_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myotonia_congenita ;
    :has_definition "A myotonia congenita that is characterized by muscle stiffness and an inability of the muscle to relax after voluntary contraction and that has_material_basis_in heterozygous mutation in the gene encoding skeletal muscle chloride channel-1 (CLCN1) on chromosome 7q34." ;
    :has_exact_synonym "Congenital myotonia, autosomal dominant form",
        "Thomsen's disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :congenital_onset ],
        :myopathy ;
    :has_definition "A myopathy that is characterized by hypotonia and weakness, usually present from birth." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myofibrillar_myopathy_11 rdfs:subClassOf :myofibrillar_myopathy ;
    :has_definition "A myofibrillar myopathy that is characterized by onset of slowly progressive proximal muscle weakness in the first decade of life and that has_material_basis_in homozygous or compound heterozygous mutation in the UNC45B gene on chromosome 17q11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_2b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by severe hypotonia with lack of spontaneous movements and respiratory insufficiency, usually leading to death in infancy or early childhood and that has_material_basis_in homozygous or compound heterozygous mutation in the ACTA1 gene on chromosome 1q42." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_2c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by severe congenital weakness usually resulting in death from respiratory failure in the first year or so of life and that has_material_basis_in heterozygous mutation in the ACTA1 gene on chromosome 1q42. Heterozygous mutation in the ACTA1 gene can also cause autosomal dominant typical congenital myopathy-2A (CMYP2A). Biallelic mutation in the ACTA1 gene causes autosomal recessive severe infantile congenital myopathy-2B (CMYP2B)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by the onset of muscle weakness in infancy manifest as neonatal hypotonia, delayed motor development, and often distal contractures and that has_material_basis_in homozygous or compound heterozygous mutation in the gene encoding titin (TTN) on chromosome 2q31." ;
    :has_exact_synonym "Salih myopathy",
        "congenital myopathy-5 with cardiomyopathy" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_8 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by hypotonia and delayed motor development apparent from infancy or childhood, resulting in difficulties walking or loss of ambulation within the first few decades and that has_material_basis_in heterozygous mutation in the ACTN2 gene on chromosome 1q43. Heterozygous mutation in the ACTN2 gene can also cause distal myopathy-6 (MPD6), which shows later onset and is less severe." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_9a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by neonatal hypotonia, poor feeding, fractures of the long bones, and respiratory insufficiency and that has_material_basis_in homozygous mutation in the FXR1 gene on chromosome 3q28." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_9b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is neonatal hypotonia followed by mildly delayed walking in childhood, mainly affecting proximal muscles, and that has_material_basis_in homozygous mutation in the FXR1 gene on chromosome 3q28. Biallelic mutation in the FXR1 gene also causes CMYP9A." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_10b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by infantile- or childhood-onset myopathy, areflexia, dysphagia, and respiratory distress that usually requires nocturnal ventilation and that has_material_basis_in homozygous or compound heterozygous mutation in the MEGF10 gene on chromosome 5q23. Biallelic mutation in the MEGF10 gene also causes a more severe congenital myopathy with overlapping features." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_14 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by onset of severe muscle weakness apparent at birth and sometimes in utero and that has_material_basis_in homozygous mutation in the MYL1 gene on chromosome 2q32. Affected infants have difficulty breathing independently and usually require mechanical ventilation for variable lengths of time." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_15 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by symptom onset soon after birth and that has_material_basis_in heterozygous mutation in the TNNC2 gene on chromosome 20q13. Affected infants are hypotonic and have severe respiratory insufficiency and feeding problems, sometimes requiring mechanical ventilation or tube feeding." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_16 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by onset of hypotonia and tremor in infancy and that has_material_basis_in heterozygous mutation in the MYBPC1 gene on chromosome 12q23. Patients have mildly delayed walking, unsteady gait, proximal muscle weakness, and a high-frequency tremor of the limbs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_17 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by hypotonia and respiratory insufficiency present at birth with associated with high diaphragmatic dome on imaging and that has_material_basis_in homozygous mutation in the MYOD1 gene on chromosome 11p15." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_18 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by the onset of symptoms of muscle weakness in early childhood, including in utero and infancy and that has_material_basis_in compound heterozygous or heterozygous mutation in the CACNA1S gene on chromosome 1q32." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_19 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by infantile-onset of progressive muscle weakness and atrophy associated with scoliosis, variably impaired walking, and dysmorphic facial features and that has_material_basis_in homozygous mutation in the PAX7 gene on chromosome 1p36." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_20 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that has_material_basis_in homozygous or compound heterozygous mutation in the RYR3 gene on chromosome 15q13 and that shows wide phenotypic variability. Some patients present in early childhood with proximal muscle weakness affecting the lower and upper limbs resulting in difficulties running and climbing, whereas others present soon after birth with congenital limb or distal contractures." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_21 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by diaphragmatic weakness and spinal rigidity and that has_material_basis_in homozygous mutation in the DNAJB4 gene on chromosome 1p31." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_22a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by onset of muscle weakness in utero or soon after birth and that has_material_basis_in homozygous or compound heterozygous mutation in the SCN4A gene on chromosome 17q23. Biallelic mutation in the SCN4A gene also causes severe fetal congenital myopathy 22B." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_myopathy_22b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_myopathy ;
    :has_definition "A congenital myopathy that is characterized by in utero onset of severe muscle weakness manifest as fetal akinesia and that has_material_basis_in homozygous or compound heterozygous mutation in the SCN4A gene on chromosome 17q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_muscular_atrophy_jokela_type rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :autosomal_dominant_disease,
        :spinal_muscular_atrophy ;
    :has_definition "A spinal muscular atrophy that is characterized by adult-onset of muscle cramps and fasciculations affecting the proximal and distal muscles of the upper and lower limbs and that has_material_basis_in heterozygous mutation in the CHCHD10 gene on chromosome 22q11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_mitochondrial_myopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :mitochondrial_myopathy ;
    :has_definition "A mitochondrial myopathy that is characterized by onset of proximal lower limb weakness and exercise intolerance in the first decade of life and that has_material_basis_in heterozygous mutation in the CHCHD10 gene on chromosome 22q11." ;
    :has_exact_synonym "Autosomal dominant mitochondrial myopathy with exercise intolerance" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermolytic_hyperkeratosis_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :epidermolytic_hyperkeratosis ;
    :has_definition "An epidermolytic hyperkeratosis that is characterized in adulthood by warty flexural hyperkeratosis with fewer erosions and blisters and that usually presents at birth with erythema and blistering and that has_material_basis_in heterozygous mutation in the keratin-1 gene (KRT1) on chromosome 12q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermolytic_hyperkeratosis_2 rdfs:subClassOf :epidermolytic_hyperkeratosis ;
    :has_definition "An epidermolytic hyperkeratosis that is characterized by generalized erythema, erosions, scaling, and easily breaking blisters that become less frequent later in life, while hyperkeratosis increases and that has_material_basis_in heterozygous or homozygous mutation in the keratin-10 gene (KRT10) on chromosome 17q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_quadriplegic_cerebral_palsy_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :paternal_variant ],
        :spastic_quadriplegic_cerebral_palsy ;
    :has_definition "A spastic quadriplegic cerebral palsy that has_material_basis_in deletion of the ANKRD15 gene (KANK1) inherited on the paternal allele." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_quadriplegic_cerebral_palsy_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :spastic_quadriplegic_cerebral_palsy ;
    :has_definition "A spastic quadriplegic cerebral palsy that has_material_basis_in homozygous mutation in the ADD3 gene on chromosome 10q24." ;
    :has_exact_synonym "CPSQ3" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pierpont_syndrome rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by distinctive facial characteristics, especially when smiling, plantar fat pads, and other limb anomalies and that has_material_basis_in heterozygous mutation in the TBL1XR1 gene on chromosome 3q26." ;
    :has_exact_synonym "Plantar lipomatosis-facial dysmorphism-developmental delay syndrome",
        "Plantar lipomatosis-unusual facies-developmental delay syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:distal_myopathy_with_rimmed_vacuoles rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :distal_myopathy ;
    :has_definition "A distal myopathy that is characterized by adult onset of muscle weakness affecting the distal upper and lower limbs, which may result in walking difficulties, as well as proximal weakness of the shoulder girdle muscles and that has_material_basis_in by heterozygous mutation in the SQSTM1 gene on chromosome 5q35." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodegeneration_with_ataxia_dystonia_and_gaze_palsy_childhood_onset rdfs:subClassOf :neurodegenerative_disease ;
    :has_definition "A neurodegenerative disease that is characterized by onset of gait ataxia, cognitive decline, and gaze palsy in the first or second decades and that has_material_basis_in homozygous mutation in the SQSTM1 gene on chromosome 5q35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paget_s_disease_of_bone_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :paget_s_disease_of_bone ;
    :has_definition "A Paget's disease of bone that has_material_basis_in heterozygous mutation in the TNFRSF11A gene, which encodes RANK, on chromosome 18q21." ;
    :has_exact_synonym "Paget disease of bone-2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paget_s_disease_of_bone_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :paget_s_disease_of_bone ;
    :has_definition "A Paget's disease of bone that has_material_basis_in heterozygous mutation in the SQSTM1 gene on chromosome 5q35." ;
    :has_exact_synonym "Paget disease of bone-3" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paget_s_disease_of_bone_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :paget_s_disease_of_bone ;
    :has_definition "A Paget's disease of bone that has_material_basis_in linkage to the 5q31 region within 12.2 cM, between D5S642 and D5S1972." ;
    :has_exact_synonym "Paget disease of bone-4" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paget_s_disease_of_bone_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :juvenile_onset ],
        :autosomal_recessive_disease,
        :paget_s_disease_of_bone ;
    :has_definition "A Paget's disease of bone that is characterized by short stature, progressive long bone deformities, fractures, vertebral collapse, skull enlargement, and hyperostosis with progressive deafness and that has_material_basis_in osteoprotegerin deficiency caused by homozygous or compound heterozygous mutation in the TNFRSF11B gene on chromosome 8q24." ;
    :has_exact_synonym "Familial osteoectasia",
        "Hereditary hyperphosphatasia",
        "Hyperostosis corticalis deformans juvenilis",
        "Juvenile Paget disease",
        "Paget disease of bone-5" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paget_s_disease_of_bone_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :paget_s_disease_of_bone ;
    :has_definition "A Paget's disease of bone that is characterized by adult onset of bone pain associated with polyostotic bone lesions primarily affecting the axial skeleton and that has_material_basis_in heterozygous mutation in the ZNF687 gene on chromosome 1q21." ;
    :has_exact_synonym "Paget disease of bone-6" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ladd_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by defects in the tear-producing lacrimal system, ear problems, dental abnormalities, and deformities of the fingers." ;
    :has_exact_synonym "Lacrimo-auriculo-dento-digital (LADD) syndrome",
        "lacrimoauriculodentodigital syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimoauriculodentodigital_syndrome_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ladd_syndrome ;
    :has_definition "A LADD syndrome that has_material_basis_in heterozygous mutation in the tyrosine kinase domain of the FGFR3 gene on chromosome 4p16 and that is mainly affecting lacrimal glands and ducts, salivary glands and ducts, ears, teeth, and distal limb segments." ;
    :has_exact_synonym "Lacrimo-auriculo-dento-digital syndrome 2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimoauriculodentodigital_syndrome_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ladd_syndrome ;
    :has_definition "A LADD syndrome that is characterized by aplasia, atresia or hypoplasia of the lacrimal and salivary systems, cup-shaped ears, hearing loss, and dental and digital anomalies and that has_material_basis_in heterozygous mutation in the FGF10 gene on chromosome 5p12." ;
    :has_exact_synonym "Lacrimo-auriculo-dento-digital syndrome 3" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:disabling_pansclerotic_morphea rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :localized_scleroderma ;
    :has_definition "A localized scleroderma that is characterized by the rapid progression of deep cutaneous fibrosis or pansclerosis that involves the subcutaneous adipose tissue and, occasionally, the fascia, muscles, and bone." ;
    :has_exact_synonym "disabling pansclerotic morphea of childhood" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nemaline_myopathy_5b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :nemaline_myopathy ;
    :has_definition "A nemaline myopathy that has_material_basis_in autosomal recessive inheritance of a homozygous or compound heterozygous mutation in the TNNT1 gene on chromosome 19q13, with childhood onset." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nemaline_myopathy_5c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :nemaline_myopathy ;
    :has_definition "A nemaline myopathy that has_material_basis_in autosomal dominant inheritance of a homozygous or compound heterozygous mutation in the TNNT1 gene on chromosome 19q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cox_deficiency_benign_infantile_mitochondrial_myopathy rdfs:subClassOf :cytochrome_c_oxidase_deficiency_disease ;
    :has_definition "A cytochrome-c oxidase deficiency disease characterized by localization to tissues of the skeletal muscles." ;
    :has_exact_synonym "Isolated cytochrome C oxidase deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_24 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :amyotrophic_lateral_sclerosis,
        :autosomal_dominant_disease ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by adult-onset loss of motor neurons and that has_material_basis_in heterozygous mutation in the NEK1 gene on chromosome 4q33." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_25 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :amyotrophic_lateral_sclerosis,
        :autosomal_dominant_disease ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by rapidly progressive muscle weakness and death due to respiratory failure and that has_material_basis_in heterozygous mutation in the KIF5A gene on chromosome 12q13. ALS25 may have a lower median age at onset (46.5 years) and longer median survival (10 years) than that found in epidemiologic studies (62.5 years and 20 to 30 months, respectively)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_26 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :amyotrophic_lateral_sclerosis,
        :autosomal_dominant_disease ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by adult onset of upper and low motor neuron disease causing bulbar dysfunction and limb weakness and that has_material_basis_in heterozygous mutation in the TIA1 gene on chromosome 2p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_amyotrophic_lateral_sclerosis_type_27 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :juvenile_onset ],
        :amyotrophic_lateral_sclerosis,
        :autosomal_dominant_disease ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by early childhood-onset lower extremity spasticity manifesting as toe walking and gait abnormalities, followed by progressive lower motor neuron-mediated weakness without sensory signs or symptoms and that has_material_basis_in heterozygous mutation in the SPTLC1 gene on chromosome 9q22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_28 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trinucleotide_repeat_expansion ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :amyotrophic_lateral_sclerosis,
        :autosomal_dominant_disease ;
    :has_definition "An amyotrophic lateral sclerosis that is characterized by adult onset of slowly progressive limb muscle weakness and atrophy resulting in gait difficulties, loss of ambulation, and distal upper limb weakness and that has_material_basis_in a heterozygous trinucleotide repeat expansion (CGG) in the 5-prime untranslated region of the LRP12 gene on chromosome 8q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxia_oculomotor_apraxia_type_4 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by onset of dystonia and ataxia in the first decade and that has_material_basis_in homozygous or compound heterozygous mutation in the PNKP gene on chromosome 19q13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxia_telangiectasia_like_disorder_1 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized clinically by progressive cerebellar degeneration resulting in ataxia and oculomotor apraxia and that has_material_basis_in homozygous or compound heterozygous mutation in the MRE11A gene (MRE11) on chromosome 11q21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxia_telangiectasia_like_disorder_2 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by developmental delay, ataxia, and sensorineural hearing loss and that has_material_basis_in homozygous mutation in the PCNA gene on chromosome 20p12." ;
    :has_exact_synonym "PCNA-related progressive neurodegenerative photosensitivity syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tango2_related_metabolic_encephalopathy_and_arrythmias rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by episodic metabolic degeneration affecting skeletal muscle, cardiac muscle, and the nervous system and that has_material_basis_in homozygous or compound heterozygous mutation in the TANGO2 gene on chromosome 22q11." ;
    :has_exact_synonym "TANGO2 deficiency",
        "metabolic encephalomyopathic crises, recurrent, with rhabdomyolysis, cardiac arrhythmias, and neurodegeneration" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_motor_and_language_delay_ocular_defects_and_brain_abnormalities rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :autosomal_recessive_intellectual_developmental_disorder ;
    :has_definition "An autosomal recessive intellectual developmental disorder that is characterized by the onset of features in infancy or early childhood and that has_material_basis_in homozygous or compound heterozygous mutation in the INTS11 gene on chromosome 1p36." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_progressive_aphasia rdfs:subClassOf :frontotemporal_dementia ;
    :has_definition "A frontotemporal dementia that characterized by the progressive onset of language impairments, and gradual deterioration of these abilities over time, associated with atrophy of the language network of the brain, including frontal, temporal, and parietal regions of the left hemisphere. It is caused by a loss of tissue (atrophy) in the area of the brain that is responsible for producing language." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:logopenic_progressive_aphasia rdfs:subClassOf :primary_progressive_aphasia ;
    :has_definition "A primary progressive aphasia that is characterized by language disturbance, including difficulty making or understanding speech. It is a type of primary progressive aphasia. Affected individuals have slow, hesitant speech due to difficulty retrieving the correct words, names, or numbers." ;
    :has_exact_synonym "Logopenic primary progressive aphasia",
        "logopenic variant PPA" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:progressive_non_fluent_aphasia rdfs:subClassOf :primary_progressive_aphasia ;
    :has_definition "A primary progressive aphasia that is characterized by agrammatism, laborious speech, alexia, and agraphia, frequently accompanied by apraxia of speech." ;
    :has_exact_synonym "Agramatic variant of primary progressive aphasia",
        "nonfluent agrammatic PPA" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:semantic_dementia rdfs:subClassOf :primary_progressive_aphasia ;
    :has_definition "A primary progressive aphasia that is characterized by the progressive, amodal and profound loss of semantic knowledge and behavioral abnormalities, attributable to the degeneration of the anterior temporal lobes." ;
    :has_exact_synonym "semantic variant PPA",
        "semantic variant of primary progressive aphasia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corticobasal_degeneration_syndrome rdfs:subClassOf :frontotemporal_dementia ;
    :has_definition "A frontotemporal dementia that characterized by the loss of cognitive functions such as the ability to think, remember, or reason to the point that it interferes with a person's daily life and activities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organophosphate_induced_delayed_polyneuropathy rdfs:subClassOf :inflammatory_and_toxic_neuropathy ;
    :has_definition "An inflammatory and toxic neuropathy that is characaterized by a collection of neuropsychological symptoms associated with repeated organophosphate pesticide exposure as well as nerve agent exposure. Symptoms can appear weeks after exposure and include muscle weakness, anxiety, depression, psychosis as well as cognitive and memory deficits." ;
    :has_exact_synonym "organophosphate induced delayed polyneuropathy" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:caroli_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :portal_vein ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :bile_duct ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        :autosomal_recessive_disease,
        :bile_duct_disease,
        :hepatic_vascular_disease,
        :syndrome,
        :vein_disease ;
    :has_definition "A syndrome that is characterized by the presence of associated congenital hepatic fibrosis and that is associated with autosomal recessive polycystic kidney disease." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:harel_yoon_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by delayed psychomotor development, intellectual disability, truncal hypotonia, spasticity, and peripheral neuropathy and that has_material_basis_in heterozygous mutation in the ATAD3A gene on chromosome 1p36." ;
    :has_exact_synonym "Ocular anomalies-axonal neuropathy-developmental delay syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_lethal_pontocerebellar_hypoplasia_hypotonia_and_respiratory_insufficiency_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :neonatal_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized in infants showing respiratory insufficiency and almost no spontaneous movement at birth, usually requiring mechanical ventilation and admission to the neonatal intensive care unit and that has_material_basis_in compound heterozygous mutation in the ATAD3A gene on chromosome 1p36.33." ;
    :has_exact_synonym "PHRINL syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vissers_bodmer_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by global developmental delay with variably impaired intellectual development, speech delay, motor delay, and behavioral abnormalities apparent from infancy and that has_material_basis_in heterozygous mutation in the CNOT1 gene on chromosome 16q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

