            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :congenital_onset ],
        :autosomal_dominant_disease,
        :holoprosencephaly ;
    :has_definition "A holoprosencephaly that is characterized by abnormal separation of the embryonic forebrain resulting in dysmorphic facial features and often, but not always, impaired neurologic development and that has_material_basis_in heterozygous mutation in the CNOT1 gene on chromosome 16q21." ;
    :has_exact_synonym "holoprosencephaly-12 with or without pancreatic agenesis" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_distal_hereditary_motor_neuronopathy_10 rdfs:subClassOf :autosomal_dominant_distal_hereditary_motor_neuronopathy ;
    :has_definition "An autosomal dominant distal hereditary motor neuronopathy that is characterized clinically by length-dependent motor neuropathy primarily affecting the lower limbs and that has_material_basis_in heterozygous mutation in the EMILIN1 gene on chromosome 2p23." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_distal_hereditary_motor_neuronopathy_11 rdfs:subClassOf :autosomal_dominant_distal_hereditary_motor_neuronopathy ;
    :has_definition "An autosomal dominant distal hereditary motor neuronopathy that is characterized by juvenile or young-adult onset of distal limb muscle weakness and atrophy mainly affecting the lower limbs, resulting in gait instability and walking difficulties and that has_material_basis_in heterozygous mutation in the SPTAN1 gene on chromosome 9q34." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_distal_hereditary_motor_neuronopathy_13 rdfs:subClassOf :autosomal_dominant_distal_hereditary_motor_neuronopathy ;
    :has_definition "An autosomal dominant distal hereditary motor neuronopathy that is characterized by distal muscle weakness and atrophy affecting both the upper and lower limbs, resulting in difficulty walking and poor fine hand motor skills and that has_material_basis_in heterozygous mutation in the BSCL2 gene on chromosome 11q12." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcoma_with_bcor_genetic_alterations rdfs:subClassOf :small_cell_sarcoma ;
    :has_definition "A small cell sarcoma that is characterized by the presence of small round or elongated malignant cells with a small amount of cytoplasm and the presence of BCOR genetic alterations." ;
    :has_exact_synonym "BCOR-Rearranged Sarcoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bcor_itd_sarcoma rdfs:subClassOf :sarcoma_with_bcor_genetic_alterations ;
    :has_definition "A sarcoma with BCOR genetic alterations that is characterized by the presence of BCOR internal tandem duplication." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bcor_ccnb3_sarcoma rdfs:subClassOf :sarcoma_with_bcor_genetic_alterations ;
    :has_definition "A sarcoma with BCOR genetic alterations that is characterized by the presence of BCOR-CCNB3 fusion gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

