            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :sarcoma_with_bcor_genetic_alterations ;
    :has_definition "A sarcoma with BCOR genetic alterations that occurs during childhood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

