    :has_definition "A small cell sarcoma that is characterized by the presence of EWSR1 or FUS fusions involving partners unrelated to the ETS gene family." ;
    :has_exact_synonym "Ewing-Like Sarcoma or Round Cell Sarcoma",
        "Round Cell Sarcoma with EWSR1::non-ETS Fusion" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_round_cell_sarcoma_with_ewsr1_non_ets_fusion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :round_cell_sarcoma_with_ewsr1_non_ets_fusion ;
    :has_definition "A round cell sarcoma with EWSR1-non-ETS fusion that is characterized by EWSR1-non-ETS fusion that occurs during childhood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:round_cell_sarcoma_with_ewsr1_nfatc2_gene_fusion rdfs:subClassOf :round_cell_sarcoma_with_ewsr1_non_ets_fusion ;
    :has_definition "A round cell sarcoma with EWSR1-non-ETS fusion that is characterized by the presence of EWSR1-NFATC2 gene fusion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:round_cell_sarcoma_with_ewsr1_patz1_gene_fusion rdfs:subClassOf :round_cell_sarcoma_with_ewsr1_non_ets_fusion ;
    :has_definition "A round cell sarcoma with EWSR1-non-ETS fusion that is characterized by the presence of EWSR1-PATZ1 gene fusion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:round_cell_sarcoma_with_fus_nfatc2_gene_fusion rdfs:subClassOf :round_cell_sarcoma_with_ewsr1_non_ets_fusion ;
    :has_definition "A round cell sarcoma with EWSR1-non-ETS fusion that is characterized by the presence of FUS-NFATC2 gene fusion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

