    :has_definition "A renal cell carcinoma with MiT translocations that is characterized by the presence of different translocations involving the chromosome Xp11.2 and that result in the creation of gene fusions involving the TFE3 gene." ;
    :has_exact_synonym "Renal Cell Carcinoma Associated with Xp11.2 Translocations/TFE3 Gene Fusions",
        "Xp11 Translocation Renal Cell Carcinoma" .

