    :has_exact_synonym "DYSTONIA 29, CHILDHOOD-ONSET",
        "DYTOABG",
        "MECR-related neurologic disorder",
        "MEPAN syndrome",
        "Mitochondrial Enoyl CoA Reductase Protein-Associated Neurodegeneration" .

