@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_focal_epilepsy_with_variable_foci_2 rdfs:subClassOf :familial_focal_epilepsy_with_variable_foci ;
    :has_definition "A familial focal epilepsy with variable foci that has_material_basis_in  heterozygous mutation in the NPRL2 gene on chromosome 3p21." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_focal_epilepsy_with_variable_foci_3 rdfs:subClassOf :familial_focal_epilepsy_with_variable_foci ;
    :has_definition "A familial focal epilepsy with variable foci that has_material_basis_in  heterozygous mutation in the NPRL3 gene on chromosome 16p13." .

