        :autosomal_recessive_disease,
        :neurodegenerative_disease ;
    :has_definition "A neurodegenerative disease characterized by autosomal recessive inheritance with early onset of severe sensory-motor polyneuropathy, variable degree of agenesis of the corpus callosum, amyotrophy, hypotonia, and cognitive impairment that has_material_basis_in homozygous or compound heterozygous mutation in the SLC12A6 gene on chromosome 15q14." ;
    :has_exact_synonym "Andermann syndrome"@en,
        "Charlevoix disease"@en,
        "corpus callosum agenesis-neuronopathy syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

