        "Burton syndrome"@en,
        "Catel-Hempel syndrome"@en,
        "Catel-Hempel type dysostosis enchondralis metaepiphysaria"@en,
        "Schwartz-Jampel syndrome type 1"@en,
        "Schwartz-Jampel-Aberfeld syndrome"@en,
        "myotonic chondrodystrophy"@en,
        "myotonic myopathy, dwarfism, chondrodystrophy, ocular and facial anomalies"@en,
        "osteochondromuscular dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_coloboma_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
