        "optic coloboma, vesicoureteral reflux and renal anomalies"@en,
        "papillo-renal syndrome, optic nerve coloboma with renal disease"@en,
        "papillorenal syndrome"@en,
        "renal-coloboma syndrome with macular abnormalities"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

