:immunodeficiency_centromeric_instability_facial_anomalies_syndrome_4 rdfs:subClassOf :immunodeficiency_centromeric_instability_facial_anomalies_syndrome ;
    :has_definition "An immunodeficiency-centromeric instability-facial anomalies syndrome characterized by autosomal recessive inheritance, recurrent infections in childhood and variable dysmorphic facial features that has_material_basis_in homozygous or compound heterozygous mutation in the HELLS gene on chromosome 10q23." ;
    :has_exact_synonym "ICF syndrome 4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_combined_immunodeficiency_with_sensitivity_to_ionizing_radiation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by being T cell-negative, B cell-negative and natural killer cell-positive with sensitivity to ionizing radiation and that has_material_basis_in mutation in the DCLRE1C gene on chromosome 10p13." ;
    :has_exact_synonym "SCID due to DCLRE1C deficiency"@en,
        "SCID due to artemis deficiency"@en,
        "SCID, Athabascan type"@en,
        "SCID, Athabaskan type"@en,
        "Severe combined immunodeficiency due to DCLRE1C deficiency"@en,
        "Severe combined immunodeficiency due to artemis deficiency"@en,
        "Severe combined immunodeficiency, Athabascan type"@en,
        "Severe combined immunodeficiency, Athabaskan type"@en,
        "artemis deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_combined_immunodeficiency_autosomal_recessive_t_cell_negative_b_cell_negative_nk_cell_positive rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by being T cell-negative, B cell-negative and natural killer cell-positive and that has_material_basis_in mutation in the RAG1 and RAG2 genes on chromosome 11p12." ;
    :has_exact_synonym "SCID due to complete RAG1-2 deficiency"@en,
        "Severe combined immunodeficiency due to complete RAG1-2 deficiency"@en,
        "autosomal recessive T cell-negative, B-cell negative, NK cell-positive SCID"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_combined_immunodeficiency_autosomal_recessive_t_cell_negative_b_cell_positive_nk_cell_positive rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :severe_combined_immunodeficiency ;
    :has_definition "A severe combined immunodeficiency characterized by being T cell-negative, B cell-positive and natural killer cell-positive and that has_material_basis_in homozygous or compound heterozygous mutation in the IL7R gene on chromosome 5p13 or the CD45 gene on chromosome 1q31." ;
    :has_exact_synonym "autosomal recessive T cell-negative, B-cell positive, NK cell-positive SCID"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cenani_lenz_syndactyly_syndrome rdfs:subClassOf :dysostosis ;
    :has_definition "A dysostosis characterized by syndactyly, malformation of the forearm and lower limb bones, renal hypoplasia or aplasia and that has_material_basis_in homozygous or compound heterozygous mutation in the LRP4 gene on chromosome 11p11." ;
    :has_exact_synonym "syndactyly type 7"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chromosome_5q_deletion_syndrome rdfs:subClassOf :chromosomal_deletion_syndrome ;
    :has_definition "A chromosomal deletion syndrome characterized by severe macrocytic anemia erythroid hypoplasia in the bone marrow, hypolobated micromegakaryocytes and that has_material_basis_in somatic deletion of 1 allele of the RPS14, MIR145, MIR146A and/or DDX41 genes on chromosome 5q." ;
    :has_exact_synonym "5q- syndrome, refractory macrocytic anemia due to 5q deletion"@en,
        "myelodysplastic syndrome associated with isolated del(5q) chromosome abnormality"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermolysis_bullosa_simplex_with_muscular_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "An syndrome characterized by early childhood onset of progressive muscular dystrophy and blistering skin changes and that has_material_basis_in homozygous or compound heterozygous mutation in the PLEC gene on chromosome 8q24." ;
    :has_exact_synonym "epidermolysis bullosa simplex and limb-girdle muscular dystrophy"@en,
        "limb-girdle muscular dystrophy with epidermolysis bullosa simplex"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_familial_periodic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by recurrent fever, abdominal pain, localized tender skin lesions, arthralgia and myalgia associated with skin, joint, ocular and serosal inflammation that has_material_basis_in heterozygous mutation in the TNFRSF1A gene on chromosome 12p13." ;
    :has_exact_synonym "FHF",
        "FPF",
        "TRAPS",
        "hibernian fever",
        "TNF receptor associated periodic syndrome"@en,
        "familial Hibernian fever"@en,
        "tumor necrosis factor receptor associated periodic syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sitosterolemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :intestinal_disease ;
    :has_definition "An intestinal disease that is characterized by autosomal recessive inheritance of unrestricted intestinal absorption of both cholesterol and plant-derived cholesterol-like molecules resulting in xanthomas, arthralgia, premature atherosclerosis, and hemolytic anemia with stomatocytosis and macrothrombocytopenia that has_material_basis_in homozygous or compound heterozygous mutation in the ABCG8 gene or in the ABCG5 gene, both of which are located on chromosome 2p21." ;
    :has_exact_synonym "phytosterolemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        :bone_development_disease ;
    :has_definition "A bone development disease characterized by malformation of the central rays of the autopod and presenting with syndactyly, median clefts of the hands and feet, and aplasia and/or hypoplasia of the phalanges, metacarpals, and metatarsals. Some patients also have mental retardation, ectodermal and craniofacial findings, and orofacial clefting." ;
    :has_exact_synonym "lobster-claw deformity"@en,
        "split-hand deformity"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in contiguous gene mutations caused by deletion, duplication, or rearrangement of chromosome 7q21.3 involving the DSS1, DLX5, and DLX6 genes and possible regulatory elements in the region." ;
    :has_exact_synonym "SHFD1"@en,
        "SHFM1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in deletions in the chromosome region 2q31." ;
    :has_exact_synonym "SHFM5"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        :autosomal_dominant_disease,
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in heterozygous mutation in the TP63 gene on chromosome 3q28." ;
    :has_exact_synonym "SHFM4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_1_with_sensorineural_hearing_loss rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation characterized by split-hand/foot malformation and sensorineural hearing impairment that has_material_basis_in homozygous mutation in the DLX5 gene on chromosome 7q21." ;
    :has_exact_synonym "SHFM1D"@en,
        "congenital deafness with split hands and feet"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_3 rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :chromosome ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :duplication ] ;
                            rdf:rest :nil ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        :chromosomal_duplication_syndrome,
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in a contiguous gene duplication syndrome on chromosome 10q24." ;
    :has_exact_synonym "SHFM3"@en,
        "chromosome 10q24 duplication syndrome"@en,
        "distal limb deficiencies with micrognathia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :split_hand_foot_malformation ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in homozygous mutation in the WNT10B gene on chromosome 12q13." ;
    :has_exact_synonym "SHFM6"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:split_hand_foot_malformation_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_inheritance ],
        :split_hand_foot_malformation,
        :x_linked_monogenic_disease ;
    :has_definition "A split-hand/foot malformation that has_material_basis_in variation in the chromosome region Xq26." ;
    :has_exact_synonym "SHFM2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_isolated_deficiency_of_vitamin_e rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :vitamin_metabolic_disorder ;
    :has_definition "A vitamin metabolic disorder characterized by progressive spino-cerebellar ataxia, loss of proprioception, areflexia, and marked deficiency in vitamin E that has_material_basis_in homozygous or compound heterozygous mutation in the TTPA gene on chromosome 8q12." ;
    :has_exact_synonym "ataxia with isolated vitamin E deficiency"@en,
        "familial isolated vitamin E deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cinca_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autoimmune_disease,
        :autosomal_dominant_disease ;
    :has_definition "An autoimmune disease characterized by neonatal onset of cutaneous symptoms, chronic meningitis, and joint manifestations with recurrent fever and inflammation that has_material_basis_in heterozygous mutation in the NLRP3 gene on chromosome 1q." ;
    :has_exact_synonym "IOMID syndrome"@en,
        "NOMID syndrome"@en,
        "Prieur-Griscelli syndrome"@en,
        "chronic infantile neurological cutaneous articular syndrome"@en,
        "chronic neurologic cutaneous and articular syndrome"@en,
        "cryopyrin-associated periodic syndrome 3"@en,
        "infantile-onset multisystem inflammatory disease"@en,
        "neonatal-onset multisystem inflammatory disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corticosteroid_binding_globulin_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :adrenal_gland_disease,
        :monogenic_disease ;
    :has_definition "An adrenal gland disease characterized by decreased levels of serum corticosteroid-binding globulin and cortisol, and in some cases hypo- or hypertension, and muscle fatigue that has_material_basis_in heterozygous or homozygous mutation in the SERPINA6 gene on chromosome 14q32." ;
    :has_exact_synonym "CBG deficiency"@en,
        "transcortin deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:d_bifunctional_protein_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :peroxisomal_disease ;
    :has_definition "A peroxisomal disease characterized by, in severe cases, infantile-onset of hypotonia, seizures, and abnormal facial features with most dieing before age 2 years that has_material_basis_in homozygous or compound heterozygous mutation in the HSD17B4 gene on chromosome 5q2." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silverman_handmaker_type_dyssegmental_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia characterized by short-limbed dwarfism, anisospondyly, and neonatal lethality that has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the gene encoding perlecan (HSPG2) on chromosome 1p36." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myoclonic_dystonia rdfs:subClassOf :dystonia ;
    :has_definition "A dystonia that is characterized by myoclonic jerks affecting mostly proximal muscles and dystonia, usually torticollis or writer's cramp, that typically responds to alcohol and has onset in the first or second decade of life." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myoclonic_dystonia_11 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myoclonic_dystonia ;
    :has_definition "A myoclonic dystonia that is characterized by myoclonic jerks affecting mostly proximal muscles, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the epsilon-sarcoglycan gene (SGCE) on chromosome 7q21." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myoclonic_dystonia_15 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myoclonic_dystonia ;
    :has_definition "A myoclonic dystonia that is characterized by jerky movements of the upper limbs, hands, and axial muscles, and has_material_basis_in autosomal dominant inheritance of variation in the chromosome region 18p11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myoclonic_dystonia_26 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :myoclonic_dystonia ;
    :has_definition "A myoclonic dystonia characterized by onset of myoclonic jerks affecting the upper limbs, progressing to dystonia with predominant involvement of the craniocervical regions, and has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the KCTD17 gene on chromosome 22q12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_13 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by focal or segmental dystonia with cranial, cervical, or upper limb involvement that has_material_basis_in autosomal dominant inheritance of variation in the chromosome region 1p36.32-p36.13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :dystonia ;
    :has_definition "A dystonia that initially involves the distal limbs and later involves the neck, orofacial, and craniocervical regions, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the hippocalcin (HPCA) gene on chromosome 1p35." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :generalized_dystonia ;
    :has_definition "A generalized dystonia that is characterized by early-onset generalised dystonia typically involing the craniocervical region with spasmodic dysphonia that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the THAP domain containing 1 gene (THAP1) on chromosome 8p11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :focal_dystonia ;
    :has_definition "A focal dystonia that is characterized by predomiantly cervical dystonia that has_material_basis_in autosomal dominant inheritance of variation in the chromosome region 18p." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by progressive laryngeal and cervical dystonia (onset in the second to third decade of life) followed by involvement of other muscles, such as the neck or limbs that has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the tubulin beta 4A class IVa (TUBB4A) gene on chromosome 19p13." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:torsion_dystonia_17 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :dystonia ;
    :has_definition "A dystonia that is characterized by progressive dystonia, dysphonia, dysarthria and neck torticollis, and has_material_basis_in autosomal recessive inheritance of variation in the chromosome region 20p11.2-q13.12." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dystonia_5 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
